(1, 'SKETCH ROBOT', 'sketch-robot', 'The future is here! Guest portraits are quickly drawn by the robot.', '<p data-start=\"338\" data-end=\"415\" style=\"text-align: justify; \"><strong data-start=\"342\" data-end=\"410\">Sketch Robot – A Futuristic Blend of Art &amp; Technology!</strong>&nbsp;</p><p data-start=\"417\" data-end=\"689\" style=\"text-align: justify;\">Now available in <strong data-start=\"434\" data-end=\"443\">Dubai</strong>, the <strong data-start=\"449\" data-end=\"475\">AI Robot Sketch Artist</strong> is a <strong data-start=\"481\" data-end=\"523\">breakthrough patent-pending technology</strong> that combines <strong data-start=\"538\" data-end=\"568\">A.I. and advanced robotics</strong> to create <strong data-start=\"579\" data-end=\"629\">stunning guest portraits in just 30-50 seconds</strong>—<strong data-start=\"630\" data-end=\"652\">three times faster</strong> than traditional sketching robots!</p><p data-start=\"691\" data-end=\"946\"><div style=\"text-align: justify;\"><strong data-start=\"694\" data-end=\"732\" style=\"font-size: 1rem;\">Why Choose AI Robot Sketch Artist?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"737\" data-end=\"764\" style=\"font-size: 1rem;\">Lightning-fast sketches</strong><span style=\"font-size: 1rem;\"> – Unique portraits in under a minute</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"806\" data-end=\"832\" style=\"font-size: 1rem;\">Interactive &amp; engaging</strong><span style=\"font-size: 1rem;\"> – A futuristic experience for guests</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"874\" data-end=\"910\" style=\"font-size: 1rem;\">Branding &amp; sharing opportunities</strong><span style=\"font-size: 1rem;\"> – Customizable outputs for events</span></div></p><p data-start=\"948\" data-end=\"1108\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Enhance your event with <strong data-start=\"972\" data-end=\"1011\">personalized, AI-generated sketches</strong>—a memorable takeaway that <strong data-start=\"1038\" data-end=\"1078\">boosts engagement &amp; brand visibility</strong>!&nbsp;</p>', 1, 'service-1740816766-1.jpg', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/mvdE55-KzMM\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/1NjT-d8SGtQ\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/KV2FcEtQcp8\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/YbmaMFJE4Ow\\\"]\"', '[\"service-gallery-1-66e3fca411840.jpg\",\"service-gallery-1-66e3fca4bbb84.jpg\",\"service-gallery-1-66e3fca583ff0.jpg\",\"service-gallery-1-6778ef218b3e7.jpeg\",\"service-gallery-1-6778fbb5ab010.jpeg\",\"service-gallery-1-6778fd68d63a8.jpeg\",\"service-gallery-1-6778fec685f94.jpeg\",\"service-gallery-1-67c1709db4e54.jpeg\",\"service-gallery-1-67c2c17ec23ff.jpg\"]', 'https://youtu.be/gib09ZBJP50', 1, '2024-09-11 07:16:16', '2025-03-04 17:44:03'),
(2, 'AI GENERATIVE', 'ai-generative', 'AI Generative Photo Booth where the power of AI meets creativity', '<p data-start=\"317\" data-end=\"387\" style=\"text-align: justify; \"><strong data-start=\"322\" data-end=\"380\">AI Generative Photo Booth – Where AI Meets Creativity!</strong>&nbsp;</p><p data-start=\"389\" data-end=\"764\" style=\"text-align: justify; \">Revolutionize your event with the <strong data-start=\"423\" data-end=\"452\">AI Generative Photo Booth</strong>, where <strong data-start=\"460\" data-end=\"490\">cutting-edge AI technology</strong> allows guests to create <strong data-start=\"515\" data-end=\"582\">custom backgrounds, avatars, and immersive AI-powered scenarios</strong> tailored to your brand. Whether for <strong data-start=\"619\" data-end=\"685\">brand activations, corporate events, or experiential marketing</strong>, this interactive booth ensures <strong data-start=\"718\" data-end=\"761\">unforgettable, highly shareable content</strong>.</p><p data-start=\"766\" data-end=\"1015\"><div style=\"text-align: justify;\"><strong data-start=\"769\" data-end=\"810\" style=\"font-size: 1rem;\">Why Choose AI Generative Photo Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"815\" data-end=\"837\" style=\"font-size: 1rem;\">Endless creativity</strong><span style=\"font-size: 1rem;\"> – Custom AI-generated avatars &amp; backgrounds</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"886\" data-end=\"924\" style=\"font-size: 1rem;\">Instant social media-ready content</strong><span style=\"font-size: 1rem;\"> – Boost brand exposure</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"952\" data-end=\"980\" style=\"font-size: 1rem;\">Fully branded experience</strong><span style=\"font-size: 1rem;\"> – Tailored to your event’s theme</span></div></p><p data-start=\"1017\" data-end=\"1164\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify;\">Unleash <strong data-start=\"1025\" data-end=\"1049\">AI-driven engagement</strong> and make your event stand out with <strong data-start=\"1085\" data-end=\"1133\">personalized, interactive brand storytelling</strong>!</p>', 1, 'service-1742201404-2.png', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/v5HffKUi8jM\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/cvK_RkR-4Cs\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/_1ZpivvXq4M\\\"]\"', '[\"service-gallery-2-66e3ff26cf8f2.jpg\",\"service-gallery-2-67790a44bcdf0.jpg\",\"service-gallery-2-67790d068bb6d.jpg\"]', 'https://www.youtube.com/watch?v=T7je5LzzNw0&t=4s', 1, '2024-09-11 07:48:31', '2025-03-17 15:50:04'),
(3, 'AI BACKGROUND', 'ai-background', 'Seamless AI backgrounds—no green screen needed!  just choose it for your event!', '<p data-start=\"315\" data-end=\"399\" style=\"text-align: justify; \"><strong data-start=\"320\" data-end=\"392\">AI Background Change Photo Booth – Next-Level Branding &amp; Engagement!</strong>&nbsp;</p><p data-start=\"401\" data-end=\"856\" style=\"text-align: justify;\">Say goodbye to <strong data-start=\"416\" data-end=\"433\">green screens</strong>! Our <strong data-start=\"439\" data-end=\"476\">AI-powered background photo booth</strong> uses <strong data-start=\"482\" data-end=\"524\">advanced facial recognition technology</strong> to seamlessly remove backgrounds and replace them with <strong data-start=\"580\" data-end=\"606\">custom-branded visuals</strong>, creating a <strong data-start=\"619\" data-end=\"652\">dynamic, immersive experience</strong>. This breakthrough innovation ensures guests enjoy a <strong data-start=\"706\" data-end=\"765\">fun, interactive, and highly shareable photo experience</strong>, making it perfect for <strong data-start=\"789\" data-end=\"853\">brand activations, corporate events, and marketing campaigns</strong>.</p><p data-start=\"858\" data-end=\"1114\"><div style=\"text-align: justify;\"><strong data-start=\"861\" data-end=\"909\" style=\"font-size: 1rem;\">Why Choose AI Background Change Photo Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"914\" data-end=\"942\" style=\"font-size: 1rem;\">No green screen required</strong><span style=\"font-size: 1rem;\"> – AI removes backgrounds instantly</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"982\" data-end=\"1011\" style=\"font-size: 1rem;\">Custom branding &amp; visuals</strong><span style=\"font-size: 1rem;\"> – Tailor designs to your event</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1047\" data-end=\"1082\" style=\"font-size: 1rem;\">Boosts engagement &amp; brand reach</strong><span style=\"font-size: 1rem;\"> – Instantly shareable content</span></div></p><p data-start=\"1116\" data-end=\"1275\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Transform your event into a <strong data-start=\"1144\" data-end=\"1177\">high-tech, branded experience</strong> with <strong data-start=\"1183\" data-end=\"1208\">AI-powered creativity</strong> that leaves a lasting impact!</p>', 1, 'service-1740819749-3.jpg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=Hm6isxqDMtk\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/S0YA0a6ENOA\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/wRdsc4kqvHk\\\"]\"', '[\"service-gallery-3-66e400c5c4099.jpg\",\"service-gallery-3-66e400c67ea2e.jpg\",\"service-gallery-3-66e400c74f1d8.jpg\",\"service-gallery-3-66e400c7774a1.jpg\"]', 'https://www.youtube.com/watch?v=reDrDifG58k', 1, '2024-09-11 07:51:59', '2025-03-04 17:49:17'),
(4, 'MIRROR BOOTH', 'mirror-booth', 'Magic Mirror captures a selfie with instant print, shareable photo and data collection', '<p data-start=\"351\" data-end=\"429\" style=\"text-align: justify; \"><strong data-start=\"355\" data-end=\"422\">Magic Mirror Photo Booth – The Ultimate Interactive Experience!</strong>&nbsp;</p><p data-start=\"431\" data-end=\"649\" style=\"text-align: justify;\">Step into the future of event entertainment with the <strong data-start=\"484\" data-end=\"536\">UAE’s only high-quality Magic Mirror Photo Booth</strong>! Designed for <strong data-start=\"551\" data-end=\"614\">luxury events, brand activations, and corporate experiences</strong>, this cutting-edge booth offers:</p><p data-start=\"651\" data-end=\"958\"><div style=\"text-align: justify;\"><strong data-start=\"654\" data-end=\"671\" style=\"font-size: 1rem;\">Key Features:</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"676\" data-end=\"712\" style=\"font-size: 1rem;\">Signature, QR, AI &amp; Green Screen</strong><span style=\"font-size: 1rem;\"> – Advanced interactive elements</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"749\" data-end=\"774\" style=\"font-size: 1rem;\">Full Red Carpet Setup</strong><span style=\"font-size: 1rem;\"> – Elevate your event’s glamour</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"810\" data-end=\"849\" style=\"font-size: 1rem;\">Instant Sharing &amp; 7-Second Printing</strong><span style=\"font-size: 1rem;\"> – No waiting, just instant fun</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"885\" data-end=\"922\" style=\"font-size: 1rem;\">Custom Branding &amp; Personalization</strong><span style=\"font-size: 1rem;\"> – Perfect for marketing campaigns</span></div></p><p data-start=\"960\" data-end=\"