(5, 'CLASSIC BOOTH', 'classic-booth', 'Photobooth—instant, high-quality photos & videos to print or share for your event!', '<p data-start=\"340\" data-end=\"409\" style=\"text-align: justify; \"> <strong data-start=\"345\" data-end=\"403\">Classic Photo Booth – Unleash Unmatched Fun &amp; Quality!</strong></p><p data-start=\"411\" data-end=\"767\" style=\"text-align: justify; \">At <strong data-start=\"414\" data-end=\"437\">Classic Photo Booth</strong>, offering an <strong data-start=\"516\" data-end=\"550\">unforgettable guest experience</strong> that your guests will remember long after the event. With <strong data-start=\"609\" data-end=\"640\">state-of-the-art technology</strong> and <strong data-start=\"645\" data-end=\"671\">high-quality equipment</strong>, our booths are packed with <strong data-start=\"700\" data-end=\"725\">mind-blowing features</strong> that ensure entertainment <strong data-start=\"752\" data-end=\"764\">non-stop</strong>!</p><p data-start=\"769\" data-end=\"1132\"><div style=\"text-align: justify;\"><strong data-start=\"772\" data-end=\"811\" style=\"font-size: 1rem;\">Why Choose Our Classic Photo Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"816\" data-end=\"854\" style=\"font-size: 1rem;\">Cutting-edge photobooth technology</strong><span style=\"font-size: 1rem;\"> – High-quality, flawless prints &amp; features</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"902\" data-end=\"935\" style=\"font-size: 1rem;\">Unmatched guest entertainment</strong><span style=\"font-size: 1rem;\"> – Fun for hours with interactive features</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"982\" data-end=\"1000\" style=\"font-size: 1rem;\">No compromises</strong><span style=\"font-size: 1rem;\"> – Only premium equipment for the best experience</span></div><div 