(6, 'GREEN SCREEN', 'green-screen', 'Photobooth with multiple background option using greenscreen background.', '<p data-start=\"340\" data-end=\"423\" style=\"text-align: justify; \"><strong data-start=\"345\" data-end=\"417\">Green Screen Photo Booth – Endless Possibilities for Fun &amp; Branding!</strong>&nbsp;</p><p data-start=\"425\" data-end=\"795\" style=\"text-align: justify; \">Take your guests on a <strong data-start=\"447\" data-end=\"468\">virtual adventure</strong> with the <strong data-start=\"478\" data-end=\"506\">Green Screen Photo Booth</strong>, where they can be transported to any scene—whether it\'s the cover of a <strong data-start=\"579\" data-end=\"591\">magazine</strong> or right in the middle of an <strong data-start=\"621\" data-end=\"639\">African safari</strong>. Our advanced <strong data-start=\"654\" data-end=\"681\">green screen technology</strong> allows for <strong data-start=\"693\" data-end=\"724\">seamless background removal</strong> and instant <strong data-start=\"737\" data-end=\"754\">customization</strong>, creating an <strong data-start=\"768\" data-end=\"792\">immersive experience</strong>.</p><p data-start=\"797\" data-end=\"1160\"><div style=\"text-align: justify;\"><strong data-start=\"800\" data-end=\"844\" style=\"font-size: 1rem;\">Why Choose the Green Screen Photo Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"849\" data-end=\"877\" style=\"font-size: 1rem;\">Customizable backgrounds</strong><span style=\"font-size: 1rem;\"> – Choose from a wide range or create your own</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"928\" data-end=\"958\" style=\"font-size: 1rem;\">Instant sharing &amp; printing</strong><span style=\"font-size: 1rem;\"> – Memories in seconds, ready for social media</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1009\" data-end=\"1033\" style=\"font-size: 1rem;\">Immersive experience</strong><span style=\"font-size: 1rem;\"> – Let your guests step into any scenario or setting</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1090\" data-end=\"1114\" style=\"font-size: 1rem;\">Perfect for branding</strong><span style=\"font-size: 1rem;\"> – Align backgrounds with your event’s theme</span></div></p><p data-start=\"1162\" data-end=\"1320\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \"><strong data-start=\"1162\" data-end=\"1191\">Make your event stand out</strong> with a fun and highly shareable experience that boosts engagement and <strong data-start=\"1262\" data-end=\"1282\">brand visibility</strong>!&nbsp;</p>', 1, 'service-1741086002-6.jpg', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/DKyvfXN_GWo\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/SL-Uihj0urg\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=SGQ7wd9F9zc\\\"]\"', '[\"service-gallery-7-66e41519c6e82.jpg\",\"service-gallery-7-66e41519cdda5.jpg\",\"service-gallery-7-66e41519d7cf6.jpg\"]', 'https://youtu.be/vQprcoHgoQQ', 1, '2024-09-11 08:02:03', '2025-03-05 18:14:58'),
(7, 'SELFIE COFFEE', 'selfie-coffee', 'Coffee art—print guest photos with cutting-edge tech for a unique event experience.', '<p data-start=\"320\" data-end=\"388\" style=\"text-align: justify; \"><strong data-start=\"324\" data-end=\"382\">Selfie Coffee – A Fun, Branded, and Edible Experience!</strong>&nbsp;</p><p data-start=\"390\" data-end=\"735\" style=\"text-align: justify;\">Take your selfie to the next level with <strong data-start=\"430\" data-end=\"447\">Selfie Coffee</strong>! Capture your perfect shot and watch as we print your face, logos, or event branding directly onto your coffee, beer, or even cookies. Our <strong data-start=\"587\" data-end=\"617\">edible printing technology</strong> uses <strong data-start=\"623\" data-end=\"654\">100% unsweetened food color</strong>, making it completely safe to enjoy while elevating your <strong data-start=\"712\" data-end=\"732\">brand visibility</strong>.</p><p data-start=\"737\" data-end=\"1036\"><div style=\"text-align: justify;\"><strong data-start=\"740\" data-end=\"769\" style=\"font-size: 1rem;\">Why Choose Selfie Coffee?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"774\" data-end=\"818\" style=\"font-size: 1rem;\">Instantly print photos, logos &amp; branding</strong><span style=\"font-size: 1rem;\"> – Personalize every cup!</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"848\" data-end=\"872\" style=\"font-size: 1rem;\">100% safe edible ink</strong><span style=\"font-size: 1rem;\"> – Enjoy your print and your drink!</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"912\" data-end=\"945\" style=\"font-size: 1rem;\">Perfect for events &amp; branding</strong><span style=\"font-size: 1rem;\"> – Memorable, shareable moments</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"981\" data-end=\"1003\" style=\"font-size: 1rem;\">Versatile printing</strong><span style=\"font-size: 1rem;\"> – Coffee, beer, cookies &amp; more</span></div></p><p data-start=\"1038\" data-end=\"1213\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Give your guests a <strong data-start=\"1057\" data-end=\"1091\">unique, interactive experience</strong> that’s perfect for <strong data-start=\"1111\" data-end=\"1177\">brand activations, corporate events, and personal celebrations</strong>.&nbsp;</p>', 1, 'service-1726218862-4.jpg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=9RpjEzqYJkk\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=4yPkLvxzO0w\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/cTrx7NzjHrA\\\"]\"', '[\"service-gallery-4-66e4026e7dadc.jpg\",\"service-gallery-4-66e4026f14f50.jpg\",\"service-gallery-4-66e4026f9fb89.jpg\",\"service-gallery-4-66e4026fa293f.jpg\"]', 'https://youtu.be/5vZEiqNroXg', 1, '2024-09-11 07:53:09', '2025-03-04 18:01:39'),
(8, 'PHYSICAL MOSAIC', 'physical-mosaic', 'We construct an astonishing mosaic on a physical wall using the guests\' images.', '<p data-start=\"312\" data-end=\"387\" style=\"text-align: justify; \"> <strong data-start=\"318\" data-end=\"381\">Photo Mosaic Wall – Create a Stunning Masterpiece Together!</strong>&nbsp;</p><p data-start=\"389\" data-end=\"780\" style=\"text-align: justify;\">Transform your event into a collaborative art experience with the <strong data-start=\"455\" data-end=\"476\">Photo Mosaic Wall</strong>! Guests, followers, or colleagues can contribute their photos, gradually creating a <strong data-start=\"561\" data-end=\"583\">living masterpiece</strong> that reveals an image as more photos are added. This engaging activity encourages participation, making it perfect for <strong data-start=\"703\" data-end=\"724\">brand activations</strong>, <strong data-start=\"726\" data-end=\"746\">corporate events</strong>, and <strong data-start=\"752\" data-end=\"777\">personal celebrations</strong>.</p><p data-start=\"782\" data-end=\"1169\"><div style=\"text-align: justify;\"><strong data-start=\"785\" data-end=\"822\" style=\"font-size: 1rem;\">Why Choose the Photo Mosaic Wall?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"827\" data-end=\"853\" style=\"font-size: 1rem;\">Interactive experience</strong><span style=\"font-size: 1rem;\"> – Guests contribute to creating a large-scale art piece</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"914\" data-end=\"932\" style=\"font-size: 1rem;\">Gradual reveal</strong><span style=\"font-size: 1rem;\"> – Watch as the overall image takes shape, building excitement</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"999\" data-end=\"1023\" style=\"font-size: 1rem;\">Perfect for branding</strong><span style=\"font-size: 1rem;\"> – Customizable to fit your event’s theme and identity</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1082\" data-end=\"1106\" style=\"font-size: 1rem;\">Great for engagement</strong><span style=\"font-size: 1rem;\"> – Keeps guests involved and entertained throughout the event</span></div></p><p data-start=\"1171\" data-end=\"1330\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Turn your event into a <strong data-start=\"1194\" data-end=\"1218\">memorable experience</strong> while boosting <strong data-start=\"1234\" data-end=\"1254\">brand visibility</strong> through a creative, shared activity!&nbsp;</p>', 1, 'service-1726221684-8.jpg', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/Yg3t-kVEBCE\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/PsZN0BJTngQ\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=w5Zh94elTZA\\\"]\"', '[\"service-gallery-8-66e40d75b1819.jpg\",\"service-gallery-8-66e40d75c0bdf.jpg\",\"service-gallery-8-66e40d7656e50.jpg\"]', 'https://youtu.be/waDk1svaAq8', 1, '2024-09-11 08:03:18', '2025-03-05 18:15:44'),
(9, 'DIGITAL MOSAIC', 'digital-mosaic', 'Make an unforgettable event highlight: dynamic digital mosaic from guests\' photos', '<p data-start=\"317\" data-end=\"396\" style=\"text-align: justify; \"><strong data-start=\"321\" data-end=\"388\">Digital Mosaic Wall – Transform Event Photos into Stunning Art!</strong>&nbsp;</p><p data-start=\"398\" data-end=\"733\" style=\"text-align: justify;\">Unveil a <strong data-start=\"407\" data-end=\"423\">jaw-dropping</strong> visual experience with the <strong data-start=\"451\" data-end=\"474\">Digital Mosaic Wall</strong>, where <strong data-start=\"482\" data-end=\"503\">live event photos</strong> are instantly transformed into a <strong data-start=\"537\" data-end=\"568\">digital and physical mosaic</strong>. Using our <strong data-start=\"580\" data-end=\"621\">exclusive, state-of-the-art algorithm</strong>, each photo submitted by your guests becomes a piece of a larger artwork, forming a breathtaking final image.</p><p data-start=\"735\" data-end=\"1078\"><div style=\"text-align: justify;\"><strong data-start=\"738\" data-end=\"777\" style=\"font-size: 1rem;\">Why Choose the Digital Mosaic Wall?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"782\" data-end=\"808\" style=\"font-size: 1rem;\">Real-time art creation</strong><span style=\"font-size: 1rem;\"> – Watch the mosaic come to life with every photo</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"862\" data-end=\"892\" style=\"font-size: 1rem;\">Digital &amp; physical mosaics</strong><span style=\"font-size: 1rem;\"> – Captures the moment in both formats</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"935\" data-end=\"958\" style=\"font-size: 1rem;\">Exclusive algorithm</strong><span style=\"font-size: 1rem;\"> – State-of-the-art technology for stunning results</span></div><div s