(11, 'GLAM BOT', 'glam-bot', 'Glam Bot Robotic Arm: Create viral content and engage guests at your event.', '<p data-start=\"74\" data-end=\"360\" style=\"text-align: justify; \"><span data-start=\"342\" data-end=\"410\" style=\"font-weight: bolder;\">Glam Bot&nbsp;</span></p><p data-start=\"74\" data-end=\"360\" style=\"text-align: justify; \">We are thrilled to unveil our <strong data-start=\"104\" data-end=\"148\">brand-new GlamBot photobooth robotic arm</strong>, designed to add cinematic magic to your events! Loved by top brands, <strong data-start=\"219\" data-end=\"236\">GlamBot Dubai</strong> captures high-speed, Hollywood-style slow-motion shots, creating <strong data-start=\"302\" data-end=\"333\">stunning, shareable content</strong> that wows your audience.</p><p data-start=\"362\" data-end=\"607\"></p><div style=\"text-align: justify;\"><strong data-start=\"365\" data-end=\"394\" style=\"font-size: 1rem;\">Why Choose GlamBot Dubai?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Elevates brand activations with </span><strong data-start=\"431\" data-end=\"461\" style=\"font-size: 1rem;\">viral, high-energy content</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Creates </span><strong data-start=\"474\" data-end=\"509\" style=\"font-size: 1rem;\">unforgettable guest experiences</strong><span style=\"font-size: 1rem;\"> with cinematic visuals</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Perfect for </span><strong data-start=\"549\" data-end=\"605\" style=\"font-size: 1rem;\">corporate events, brand launches, and luxury parties</strong></div><p></p><p data-start=\"609\" data-end=\"746\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Step into the spotlight and let <strong data-start=\"641\" data-end=\"658\">GlamBot Dubai</strong> turn your event into a viral sensation!</p>', 1, 'service-1741084916-11.jpeg', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/gkvh_XI_lH0\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=cu7Bt1S7atw\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=UthjAUU-SbI\\\"]\"', '[\"service-gallery-11-66e40be05d787.jpg\",\"service-gallery-11-66e40be0e7c9e.jpg\",\"service-gallery-11-66e40be179f88.jpg\",\"service-gallery-11-67c6c7a0f3290.jpg\"]', 'https://www.youtube.com/watch?v=cu7Bt1S7atw', 3, '2024-09-11 08:16:52', '2025-03-05 14:57:26'),
(12, 'CAPTION CAM', 'caption-cam', 'Express yourself—write, draw, and receive a custom branded video instantly.', '<p data-start=\"0\" data-end=\"62\" style=\"text-align: justify; \"><span data-start=\"342\" data-end=\"410\" style=\"font-weight: bolder;\">Caption Cam</span></p><p data-start=\"0\" data-end=\"62\" style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">Give your guests the ultimate creative freedom with </span><strong data-start=\"116\" data-end=\"131\" style=\"font-size: 1rem;\">Caption Cam</strong><span style=\"font-size: 1rem;\">, an interactive </span><strong data-start=\"148\" data-end=\"163\" style=\"font-size: 1rem;\">video booth</strong><span style=\"font-size: 1rem;\"> that lets them </span><strong data-start=\"179\" data-end=\"222\" style=\"font-size: 1rem;\">write, draw, and express their thoughts</strong><span style=\"font-size: 1rem;\"> in real time. Each video is custom-branded and instantly shareable on </span><strong data-start=\"293\" data-end=\"309\" style=\"font-size: 1rem;\">social media</strong><span style=\"font-size: 1rem;\"> or displayed as a </span><strong data-start=\"328\" data-end=\"352\" style=\"font-size: 1rem;\">digital freedom wall</strong><span style=\"font-size: 1rem;\"> at your event.</span></p><p data-start=\"371\" data-end=\"628\"></p><div style=\"text-align: justify;\"><strong data-start=\"374\" data-end=\"401\" style=\"font-size: 1rem;\">Why Choose Caption Cam?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"406\" data-end=\"434\" style=\"font-size: 1rem;\">Real-time video creation</strong><span style=\"font-size: 1rem;\"> – No waiting, no post-processing</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"472\" data-end=\"494\" style=\"font-size: 1rem;\">Fully customizable</strong><span style=\"font-size: 1rem;\"> – Designs, end displays &amp; animations tailored to your brand</spa