(13, 'SPIN 360 Booth', 'spin-360-booth', 'Experience 360° spin videos with stunning effects, instantly shareable via QR.', '<p data-start=\"0\" data-end=\"65\" style=\"text-align: justify; \"><span data-start=\"342\" data-end=\"410\" style=\"font-weight: bolder;\">Spin 360 Video Booth</span></p><p data-start=\"0\" data-end=\"65\" style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">Take your event to the next level with the </span><strong data-start=\"110\" data-end=\"149\" style=\"font-size: 1rem;\">Interactive Amazing 360 Video Booth</strong><span style=\"font-size: 1rem;\">! Guests step onto the branded platform as the slow-motion camera arm circles them, capturing </span><strong data-start=\"243\" data-end=\"272\" style=\"font-size: 1rem;\">stunning 360-degree video</strong><span style=\"font-size: 1rem;\"> from every angle. Perfect for creating unforgettable, shareable moments at events, brand activations, and more.</span></p><p data-start=\"388\" data-end=\"637\"></p><div style=\"text-align: justify;\"><strong data-start=\"391\" data-end=\"421\" style=\"font-size: 1rem;\">Why Choose Spin 360 Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"426\" data-end=\"450\" style=\"font-size: 1rem;\">Immersive experience</strong><span style=\"font-size: 1rem;\"> – Captures every moment from all angles</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"564\" data-end=\"589\" style=\"font-size: 1rem;\">Customizable branding</strong><span style=\"font-size: 1rem;\"> – Create unique, viral content for your brand</span></div><p></p><p data-start=\"639\" data-end=\"788\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Let your guests spin into the spotlight with <strong data-start=\"684\" data-end=\"702\">Spin 360 Booth</strong>—where every angle is a perfect shot!</p>', 1, 'service-1726223243-14.jpg', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/JNNH833rKxk\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=Am7YeRvujxQ\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=a8sBzyXQT5g\\\",null]\"', '[\"service-gallery-14-66e4138cd9ca3.jpg\",\"service-gallery-14-66e4138d4e7f0.jpg\",\"service-gallery-14-66e4138ddc8a8.jpg\"]', 'https://youtu.be/2J1AYvWn49g', 3, '2024-09-11 08:18:53', '2025-03-05 18:17:21'),
(14, '360 LOOP BOOTH', '360-loop-booth', 'Create 360° videos with shareable content that boosts brand visibility.', '<p data-start=\"0\" data-end=\"65\" style=\"text-align: justify; \"><span data-start=\"342\" data-end=\"410\" style=\"font-weight: bolder;\">Spin 360 loop Video Booth</span></p><p data-start=\"0\" data-end=\"65\" style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">Give your guests a </span><strong data-start=\"86\" data-end=\"121\" style=\"font-size: 1rem;\">fun, immersive video experience</strong><span style=\"font-size: 1rem;\"> with a </span><strong data-start=\"129\" data-end=\"171\" style=\"font-size: 1rem;\">360-degree loop and virtual background</strong><span style=\"font-size: 1rem;\">! Perfect for </span><strong data-start=\"185\" data-end=\"206\" style=\"font-size: 1rem;\">brand activations</strong><span style=\"font-size: 1rem;\">, this interactive booth allows guests to create </span><strong data-start=\"255\" data-end=\"284\" style=\"font-size: 1rem;\">dynamic, shareable videos</strong><span style=\"font-size: 1rem;\"> that can be instantly uploaded to social media—boosting your brand’s reach and engagement.</span></p><p data-start=\"379\" data-end=\"610\"></p><div style=\"text-align: justify;\"><strong data-start=\"382\" data-end=\"412\" style=\"font-size: 1rem;\">Why Choose 360 Loop Video?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"417\" data-end=\"456\" style=\"font-size: 1rem;\">Exciting, interactive video capture</strong><span style=\"font-size: 1rem;\"> with virtual backgrounds</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"486\" data-end=\"518\" style=\"font-size: 1rem;\">Instant social media sharing</strong><span style=\"font-size: 1rem;\"> for maximum brand exposure</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"550\" data-end=\"577\" style=\"font-size: 1rem;\">Custom branding options</strong><span style=\"font-size: 1rem;\"> to enhance your event presence</span></div><p></p><p data-start=\"612\" data-end=\"740\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Turn every moment into a <strong data-start=\"637\" data-end=\"653\">viral-worthy</strong> experience with <strong data-start=\"670\" data-end=\"688\">360 Loop Video</strong>!&nbsp;</p>', 1, 'service-1741084327-14.jpg', '\"[null]\"', '[\"service-gallery-12-66e41310b2615.jpg\",\"service-gallery-12-66e41310ce8c1.jpg\",\"service-gallery-14-67c6d7a9d2df0.jpg\"]', 'https://youtu.be/WcoTT-uO9mY', 3, '2024-09-11 08:17:25', '2025-03-05 18:16:52'),
(15, 'VOGUE BOOTH', 'vogue-booth', 'Vogue Video Booth: A glam video experience with stunning light effects.', '<p data-start=\"311\" data-end=\"383\" style=\"text-align: justify; \"><strong data-start=\"315\" data-end=\"376\">Vogue Video Booth – Your Glamorous Moment in Every Frame!</strong>&nbsp;</p><p data-start=\"385\" data-end=\"808\" style=\"text-align: justify; \">Transform your event into a <strong data-start=\"413\" data-end=\"432\">fashion-forward</strong> experience with the <strong data-start=\"453\" data-end=\"474\">Vogue Video Booth</strong>! This <strong data-start=\"481\" data-end=\"506\">glamorous video booth</strong> captures stunning video clips, enclosed in a light box that adds magnificent MTV-style effects to every moment. Whether it’s for a <strong data-start=\"638\" data-end=\"658\">brand activation</strong>, <strong data-start=\"660\" data-end=\"679\">corporate event</strong>, or <strong data-start=\"684\" data-end=\"708\">personal celebration</strong>, the Vogue Video Booth adds a touch of <strong data-start=\"748\" data-end=\"768\">luxury and flair</strong>, turning every guest into a <strong data-start=\"797\" data-end=\"805\">star</strong>.</p><p data-start=\"810\" data-end=\"1142\"><div style=\"text-align: justify;\"><strong data-start=\"813\" data-end=\"850\" style=\"font-size: 1rem;\">Why Choose the Vogue Video Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"855\" data-end=\"883\" style=\"font-size: 1rem;\">Glamorous video captures</strong><span style=\"font-size: 1rem;\"> – MTV-style effects that elevate every clip</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"932\" data-end=\"957\" style=\"font-size: 1rem;\">Customizable lighting</strong><span style=\"font-size: 1rem;\"> – Enhance the mood of your event</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"995\" data-end=\"1019\" style=\"font-size: 1rem;\">Perfect for branding</strong><span style=\"font-size: 1rem;\"> – Adds a high-end feel to your brand’s activation</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1074\" data-end=\"1093\" style=\"font-size: 1rem;\">Instant sharing</strong><span style=\"font-size: 1rem;\"> – Quick and easy sharing of your stylish clips</span></div></p><p data-start=\"1144\" data-end=\"1264\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Make your event a <strong data-start=\"1162\" data-end=\"1180\">VIP experience</strong> with videos that will leave a lasting impression!&nbsp;</p>', 1, 'service-1726223440-15.jpg', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/XXwctxZN_UY\\\"]\"', '[\"service-gallery-15-66e4145127cf9.jpg\",\"service-gallery-15-66e4145136b56.jpg\",\"service-gallery-15-66e4145145f95.jpg\"]', 'https://youtu.be/XXwctxZN_UY', 1, '2024-09-11 08:19:36', '2025-03-04 18:10:29'),
(16, 'TESTIMONIAL', 'testimonial', 'Capture guest responses instantly as branded HD videos.', '<p data-start=\"341\" data-end=\"418\" style=\"text-align: justify; \"><span data-start=\"488\" data-end=\"515\" style=\"font-size: 1rem; font-weight: bolder;\">Testimonial Video Booth</span></p><p data-start=\"341\" data-end=\"418\" style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">Turn guest experiences into </span><strong data-start=\"448\" data-end=\"478\" style=\"font-size: 1rem;\">powerful marketing content</strong><span style=\"font-size: 1rem;\"> with the </span><strong data-start=\"488\" data-end=\"515\" style=\"font-size: 1rem;\">Testimonial Video Booth</strong><span style=\"font-size: 1rem;\">! Engage your audience by asking </span><strong data-start=\"548\" data-end=\"574\" style=\"font-size: 1rem;\">personalized questions</strong><span style=\"font-size: 1rem;\"> and recording their responses in high-quality, branded HD video clips. Whether it\'s testimonials, event reactions, or fun confessions, each clip is instantly compiled, ready for sharing and </span><strong data-start=\"765\" data-end=\"784\" style=\"font-size: 1rem;\">brand promotion</strong><span style=\"font-size: 1rem;\">.</span></p><p data-start=\"789\" data-end=\"1052\"></p><div style=\"text-align: justify;\"><strong data-start=\"792\" data-end=\"831\" style=\"font-size: 1rem;\">Why Choose Testimonial Video Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"836\" data-end=\"869\" style=\"font-size: 1rem;\">Authentic audience engagement</strong><span style=\"font-size: 1rem;\"> – Real stories from real people</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"906\" data-end=\"935\" style=\"font-size: 1rem;\">Instant branded HD videos</strong><span style=\"font-size: 1rem;\"> – Ready to use for campaigns &amp; social media</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"984\" data-end=\"1009\" style=\"font-size: 1rem;\">Customizable branding</strong><span style=\"font-size: 1rem;\"> – Tailor questions, backgrounds &amp; themes</span></div><p></p><p data-start=\"1054\" data-end=\"1228\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify;\">Enhance your <strong data-start=\"1067\" data-end=\"1111\">brand credibility and marketing strategy</strong> with real voices and real impact—only with <strong data-start=\"1155\" data-end=\"1188\">Testimonial Video Booth Dubai</strong>!&nbsp;</p>', 1, 'service-1726226064-16.jpg', '\"[null]\"', '[]', 'https://youtu.be/-SGD6S42k6Q', 3, '2024-09-11 08:20:11', '2025-03-05 18:18:03'),
(17, 'INSTANT TATTOO', 'instant-tattoo', 'Print the events logos, text, or icons with the use of our innovative tattoo machine.', '<p><span style=\"color: rgb(94, 94, 94); font-family: Helvetica, arial, sans-serif; font-size: 24px;\">The UAE\'s first comprehensive temporary tattoo device. Allow users to apply any designs they want right to their skin. We make it possible to safely, swiftly, and easily put your personalized temporary tattoos to skin, as well as providing clients&nbsp;with a new creative tool for your brand expression.</span><br></p>', 0, 'service-1726226280-17.jpg', '\"[null]\"', '[\"service-gallery-17-66e41f684e788.jpg\",\"service-gallery-17-66e41f685c2ff.jpg\",\"service-gallery-17-66e41f686df79.jpg\"]', 'https://youtu.be/uk0Zk_wXr54', 2, '2024-09-11 08:25:15', '2025-02-28 18:25:15');
INSERT INTO `services` (`id`, `name`, `slug`, `short_desc`, `description`, `status`, `image`, `additional_videos_links`, `gallery_images`, `videos_link`, `category_id`, `created_at`, `updated_at`) VALUES
(18, 'POWER BIKES', 'power-bikes', 'Using our power bikes, build games for all of your guests to enjoy and engage in.', '<p data-start=\"368\" data-end=\"447\" style=\"text-align: justify; \"><strong data-start=\"372\" data-end=\"441\">Power Bike Challenge – The Ultimate Interactive Event Activation!</strong>&nbsp;</p><p data-start=\"449\" data-end=\"812\" style=\"text-align: justify;\"><strong data-start=\"449\" data-end=\"522\">Bring energy and excitement to your event with our Pedal Power Bikes!</strong> Participants jump on a specially designed bicycle generator and <strong data-start=\"587\" data-end=\"634\">challenge themselves to produce electricity</strong> by pedaling. The goal? <strong data-start=\"658\" data-end=\"685\">Light up the event logo</strong> and keep it shining for the longest time! It’s a thrilling activity that keeps guests engaged, competitive, and entertained.</p><p data-start=\"814\" data-end=\"983\"><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"817\" data-end=\"834\" style=\"font-size: 1rem;\">How It Works:</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">🚴 Participants pedal to generate electricity.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">💡 The energy powers up the event logo.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">🏆 The challenge? </span><strong data-start=\"946\" data-end=\"981\" data-is-only-node=\"\" style=\"font-size: 1rem;\">Keep the lights on the longest!</strong></div></p><p data-start=\"985\" data-end=\"1317\"><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"988\" data-end=\"1028\" style=\"font-size: 1rem;\">Why Choose the Power Bike Challenge?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1033\" data-end=\"1054\" style=\"font-size: 1rem;\">Interactive &amp; Fun</strong><span style=\"font-size: 1rem;\"> – Guests love the competition!</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1090\" data-end=\"1110\" data-is-only-node=\"\" style=\"font-size: 1rem;\">Brand Activation</strong><span style=\"font-size: 1rem;\"> – A creative way to showcase your logo.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1155\" data-end=\"1171\" style=\"font-size: 1rem;\">Eco-Friendly</strong><span style=\"font-size: 1rem;\"> – Promotes sustainability with pedal-generated power.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1230\" data-end=\"1256\" style=\"font-size: 1rem;\">Perfect for All Events</strong><span style=\"font-size: 1rem;\"> – Corporate activations, exhibitions, festivals, and more.</span></div></p><p data-start=\"1319\" data-end=\"1540\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Now available for event rentals in <strong data-start=\"1354\" data-end=\"1375\">Abu Dhabi &amp; Dubai</strong>, our <strong data-start=\"1381\" data-end=\"1402\">Pedal Power Bikes</strong> will make your event stand out! Who will be the ultimate champion? Let’s find out! 🔥&nbsp;</p>', 1, 'service-1741155147-18.jpeg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=U9kLwb4XFZE\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/zA378y_IcjI\\\"]\"', '[\"service-gallery-21-66e40a4777739.jpg\",\"service-gallery-21-66e40a478193c.jpg\",\"service-gallery-21-66e40a478a895.jpg\",\"service-gallery-18-677b961059e3e.jpeg\",\"service-gallery-18-677b9610701c9.jpeg\",\"service-gallery-18-677b979e4d473.jpeg\",\"service-gallery-18-677b979e5f507.jpeg\"]', 'https://www.youtube.com/watch?v=qW-8OvTRtcQ', 2, '2024-09-11 08:28:17', '2025-03-05 13:12:27'),
(19, 'SPEED CATCH', 'speed-catch', 'Test your reaction speed in a fast-paced, competitive challenge.', '<p data-start=\"322\" data-end=\"387\" style=\"text-align: justify; \"><strong data-start=\"326\" data-end=\"381\">Speed Catch Game – The Ultimate Reaction Challenge!</strong>&nbsp;</p><p data-start=\"389\" data-end=\"712\" style=\"text-align: justify;\">Put your guests to the test with the <strong data-start=\"426\" data-end=\"446\">Speed Catch Game</strong>, a <strong data-start=\"450\" data-end=\"498\">highly competitive, energetic, and addictive</strong> activation designed to challenge <strong data-start=\"532\" data-end=\"562\">reaction time and reflexes</strong>. Perfect for corporate events, trade shows, and interactive activations, this game brings <strong data-start=\"653\" data-end=\"696\">excitement, engagement, and competition</strong> to any event!</p><p data-start=\"714\" data-end=\"935\"><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"717\" data-end=\"734\" style=\"font-size: 1rem;\">How It Works:</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">🔹 Players react as fast as possible to catch or tap targets.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">🔹 The faster the response, the higher the score!</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">🔹 Challenge friends, colleagues, or competitors in this fun and thrilling game.</span></div></p><p data-start=\"937\" data-end=\"1207\"><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"940\" data-end=\"976\" style=\"font-size: 1rem;\">Why Choose the Speed Catch Game?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"981\" data-end=\"1007\" style=\"font-size: 1rem;\">Engaging &amp; Competitive</strong><span style=\"font-size: 1rem;\"> – Keeps guests entertained for hours!</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1050\" data-end=\"1070\" data-is-only-node=\"\" style=\"font-size: 1rem;\">Branding Options</strong><span style=\"font-size: 1rem;\"> – Fully customizable with your event logo.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1118\" data-end=\"1150\" style=\"font-size: 1rem;\">Perfect for Corporate Events</strong><span style=\"font-size: 1rem;\"> – Ideal for team-building and interactive experiences.</span></div></p><p data-start=\"1209\" data-end=\"1452\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Bring the <strong data-start=\"1222\" data-end=\"1251\">ultimate reflex challenge</strong> to your event and see who reigns supreme! Available for event activations with <strong data-start=\"1331\" data-end=\"1356\">full branding options</strong>. Who has the fastest reaction time? Let’s find out!&nbsp;</p>', 1, 'service-1741156030-19.jpeg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=oChldrdPVB4\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=JI5CIJ8nyx0\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/oChldrdPVB4\\\"]\"', '[\"service-gallery-22-66e411c90f2b1.jpg\",\"service-gallery-22-66e411c91ae1c.jpg\",\"service-gallery-22-66e411c926992.jpg\",\"service-gallery-19-677b9c338ddb7.jpeg\",\"service-gallery-19-677b9c33f2ef3.jpeg\",\"service-gallery-19-677b9c3463360.jpg\"]', 'https://www.youtube.com/watch?v=y6SRS4NWr04', 2, '2024-09-11 08:28:52', '2025-03-05 13:27:10'),
(20, 'CLAW MACHINE', 'claw-machine', 'A fun, interactive way to engage guests and promote your brand.', '<h3 data-start=\"73\" data-end=\"142\" style=\"text-align: justify; \"><span data-start=\"326\" data-end=\"381\" style=\"font-weight: bolder; font-size: 16px;\">Claw Machine&nbsp;</span></h3><p data-start=\"144\" data-end=\"347\" style=\"text-align: justify;\">Make your event <strong data-start=\"160\" data-end=\"177\">unforgettable</strong> with our <strong data-start=\"187\" data-end=\"219\">Claw Machine Rental in UAE</strong>! This fun-filled game <strong data-start=\"303\" data-end=\"321\">engages guests</strong> and creates excitement.</p><p data-start=\"144\" data-end=\"347\" style=\"text-align: justify;\"><strong data-start=\"352\" data-end=\"369\" style=\"font-size: 1rem;\">How It Works:</strong></p><p data-start=\"144\" data-end=\"347\" style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Guests use the joystick to control the claw and grab exciting prizes—branded merchandise, plush toys, or promotional items!</span></p><p></p><p data-start=\"499\" data-end=\"789\"></p><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"502\" data-end=\"534\" style=\"font-size: 1rem;\">Why Choose Our Claw Machine?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"539\" data-end=\"558\" style=\"font-size: 1rem;\">Custom Branding</strong><span style=\"font-size: 1rem;\"> – Personalize it with your logo &amp; theme.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"604\" data-end=\"623\" style=\"font-size: 1rem;\">High Engagement</strong><span style=\"font-size: 1rem;\"> – Attracts crowds &amp; boosts brand awareness.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"672\" data-end=\"692\" style=\"font-size: 1rem;\">Fun for Everyon