(21, 'MEMORY GAME', 'memory-game', 'Engage customers with a branded, interactive Memory Game experience.', '<h3 data-start=\"0\" data-end=\"42\" style=\"text-align: justify; \"><span data-start=\"326\" data-end=\"381\" style=\"font-weight: bolder; font-size: 16px;\">Memory Game - Match &amp; Win</span></h3><p data-start=\"44\" data-end=\"239\" style=\"text-align: justify;\">Test your memory and speed with our <strong data-start=\"80\" data-end=\"105\">Memory Game Challenge</strong>! Match the same icons <strong data-start=\"128\" data-end=\"146\">under a minute</strong> to win exciting prizes. This interactive game is perfect for engaging guests at any event.</p><p data-start=\"241\" data-end=\"583\"></p><div style=\"text-align: justify;\"><strong data-start=\"244\" data-end=\"275\" style=\"font-size: 1rem;\">Why Choose Our Memory Game?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"280\" data-end=\"300\" data-is-only-node=\"\" style=\"font-size: 1rem;\">Fast-Paced &amp; Fun</strong><span style=\"font-size: 1rem;\"> – Keeps guests entertained and engaged.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"345\" data-end=\"364\" style=\"font-size: 1rem;\">Custom Branding</strong><span style=\"font-size: 1rem;\"> – Personalize icons and game setup to match your event.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"425\" data-end=\"449\" style=\"font-size: 1rem;\">Perfect for All Ages</strong><span style=\"font-size: 1rem;\"> – Great for corporate events, trade shows, and activations.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"514\" data-end=\"533\" style=\"font-size: 1rem;\">Exciting Prizes</strong><span style=\"font-size: 1rem;\"> – Reward participants for their quick thinking!</span></div><p></p><p data-start=\"5