(23, 'SLING SHOT', 'sling-shot', 'Engage audience with a digital slingshot—snap, aim, and make your mark.', '<h3 data-start=\"0\" data-end=\"57\" style=\"text-align: justify; \"><span data-start=\"372\" data-end=\"441\" style=\"font-size: 1rem; font-weight: bolder;\">Sling Shot - Snap, Aim &amp; Shoot</span></h3><p data-start=\"59\" data-end=\"462\" style=\"text-align: justify;\">Take event engagement to the next level with our <strong data-start=\"108\" data-end=\"147\">fully customized Digital Sling Shot</strong> in Dubai! We’ve reimagined the classic <strong data-start=\"187\" data-end=\"200\">slingshot</strong> with a <strong data-start=\"208\" data-end=\"225\">digital twist</strong>, making it an exciting and interactive experience for guests of all ages. Whether capturing a <strong data-start=\"320\" data-end=\"350\">photo and adding a message</strong> or participating in a <strong data-start=\"373\" data-end=\"393\">fun virtual game</strong>, this activation guarantees fun, creativity, and brand engagement!</p><p data-start=\"464\" data-end=\"861\"></p><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"466\" data-end=\"504\" style=\"font-size: 1rem;\">Why Choose the Digital Sling Shot?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"509\" data-end=\"531\" data-is-only-node=\"\" style=\"font-size: 1rem;\">Fully Customizable</strong><span style=\"font-size: 1rem;\"> – Personalize branding, themes, and game mechanics.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"588\" data-end=\"609\" style=\"font-size: 1rem;\">Fun &amp; Interactive</strong><span style=\"font-size: 1rem;\"> – Guests can snap a picture, write a message, and launch it digitally!</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"685\" data-end=\"718\" style=\"font-size: 1rem;\">Perfect for Brand Activations</strong><span style=\"font-size: 1rem;\"> – Drive engagement and foot traffic to your booth or event.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"783\" data-end=\"806\" style=\"font-size: 1rem;\">Gamified Experience</strong><span style=\"font-size: 1rem;\"> – Create a competitive and entertaining environment.</span></div><p></p><p data-start=\"989\" data-end=\"1207\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \"><strong data-start=\"992\" data-end=\"1065\">Snap, aim, and shoot your way into an unforgettable event experience!</strong> Book the <strong data-start=\"1075\" data-end=\"1097\">Digital Sling Shot</strong> today and watch your guests engage like never before!&nbsp;</p>', 1, 'service-1726222519-26.jpg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=G_m0De_CtNw\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/V1iWOx3yApk\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=PQ42mGInxB8\\\"]\"', '[\"service-gallery-26-66e410b94d157.jpg\",\"service-gallery-26-66e410ba00882.jpg\",\"service-gallery-26-66e410bab68fd.jpg\"]', 'https://www.youtube.com/watch?v=ZosrjxOSBtI', 2, '2024-09-11 08:32:05', '2025-03-05 15:22:47'),
(24, 'FLAG GAME', 'flag-game', 'Boost brand engagement with the interactive \"Guess the Flag game\".', '<h3 data-start=\"0\" data-end=\"77\" style=\"text-align: justify; \"><span data-start=\"372\" data-end=\"441\" style=\"font-size: 1rem; font-weight: bolder;\">Interactive Guess the Flag Game</span><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"9\" data-end=\"70\" style=\"color: inherit; font-family: inherit; font-size: 1.75rem;\">&nbsp;</strong></h3><p data-start=\"79\" data-end=\"329\" style=\"text-align: justify;\">Bring excitement and engagement to your event with the <strong data-start=\"134\" data-end=\"170\">Interactive Guess the Flag Game!</strong>&nbsp;This game proved to be an <strong data-start=\"242\" data-end=\"327\" data-is-only-node=\"\">amazing way to entertain and educate guests while connecting them with the brand.</strong></p><p data-start=\"331\" data-end=\"608\"></p><div style=\"text-align: justify;\"><strong data-start=\"334\" data-end=\"351\" style=\"font-size: 1rem;\">How It Works:</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Participants test their </span><strong data-start=\"378\" data-end=\"404\" style=\"font-size: 1rem;\">geographical knowledge</strong><span style=\"font-size: 1rem;\"> by guessing the correct flag within a time limit! The faster they answer, the higher their score. The game can be </span><strong data-start=\"519\" data-end=\"539\" style=\"font-size: 1rem;\">fully customized</strong><span style=\"font-size: 1rem;\"> to include </span><strong data-start=\"551\" data-end=\"589\" style=\"font-size: 1rem;\">brand elements, themes, and prizes</strong><span style=\"font-size: 1rem;\"> for the winners.</span></div><p></p><p data-start=\"610\" data-end=\"971\"></p><div style=\"text-align: justify;\"><strong data-start=\"612\" data-end=\"647\" style=\"font-size: 1rem;\">Why Choose Guess the Flag Game?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"652\" data-end=\"670\" style=\"font-size: 1rem;\">Fun &amp; Engaging</strong><span style=\"font-size: 1rem;\"> – Keeps gu0ests entertained while learning.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"718\" data-end=\"738\" style=\"font-size: 1rem;\">Brand Activation</strong><span style=\"font-size: 1rem;\"> – Customize the interface with your logo and branding.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"798\" data-end=\"827\" style=\"font-size: 1rem;\">Competitive &amp; Interactive</strong><span style=\"font-size: 1rem;\"> – Encourages participation with prizes for winners.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"884\" data-end=\"925\" style=\"font-size: 1rem;\">Perfect for Corporate &amp; Public Events</strong><span style=\"font-size: 1rem;\"> – A great way to attract and engage crowds.</span></div><p></p><p data-start=\"973\" data-end=\"1096\" style=\"text-align: justify;\"><strong data-start=\"1101\" data-end=\"1152\" style=\"font-size: 1rem;\">Make your event more interactive and memorable!</strong><span style=\"font-size: 1rem;\"> Book the </span><strong data-start=\"1162\" data-end=\"1185\" style=\"font-size: 1rem;\">Guess the Flag Game</strong><span style=\"font-size: 1rem;\"> today and engage your audience in a fun and exciting way!&nbsp;</span></p>', 1, 'service-1741159119-24.jpeg', '\"[null]\"', '[]', 'https://youtu.be/3gt1x5CaJog', 2, '2024-09-11 08:32:35', '2025-03-05 15:23:38'),
(25, 'PHOTO PUZZLE', 'photo-puzzle', 'Prepare to have some fun with these interesting time-measuring challenges. Photo puzzle.', '<p><span style=\"font-family: Arial; font-size: 21px;\"><font color=\"#000000\">Prepare to have some fun with these interesting time-measuring challenges. This is a quick-wit picture puzzle. The system will first have 10 seconds to take the players picture with the webcam. Following that picture, you\'ll see a jumbled puzzle piece that the player must organize. You have 120 seconds or two minutes to accomplish it, or else you will lose the game.</font></span><br></p>', 0, 'service-1726226617-28.jpg', '\"[null]\"', '[]', 'https://youtu.be/EC37vcIZ8rw', 2, '2024-09-11 08:33:21', '2025-02-28 20:39:44'),
(26, 'MAGAZINE BOOTH', 'magazine-booth', 'Take your event to the next level with custom magazine covers and memories.', '<p data-start=\"315\" data-end=\"383\" style=\"text-align: justify; \">&nbsp;<strong data-start=\"319\" data-end=\"376\">MAGAZINE BOOTH WITH CLICK &amp; PRINT – Create Your Own Cover Story!</strong>&nbsp;</p><p data-start=\"385\" data-end=\"752\" style=\"text-align: justify;\">Take your event to the next level with the <strong data-start=\"428\" data-end=\"454\">MAGAZINE BOOTH </strong>! Let your guests become the star of their own magazine cover, complete with customizable headlines and images. Whether it’s for a <strong data-start=\"585\" data-end=\"605\">brand activation</strong>, <strong data-start=\"607\" data-end=\"626\">corporate event</strong>, or <strong data-start=\"631\" data-end=\"654\">special celebration</strong>, this booth offers a fun and memorable experience where everyone gets to feel like a celebrity.</p><p data-start=\"754\" data-end=\"1114\"><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"757\" data-end=\"799\" style=\"font-size: 1rem;\">Why Choose the Picture Magazine Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"804\" data-end=\"837\" style=\"font-size: 1rem;\">Create unique magazine covers</strong><span style=\"font-size: 1rem;\"> – Personalized with headlines, images, and more</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"890\" data-end=\"914\" style=\"font-size: 1rem;\">Perfect for branding</strong><span style=\"font-size: 1rem;\"> – Customize the magazine theme to fit your brand</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"968\" data-end=\"987\" style=\"font-size: 1rem;\">Interactive fun</strong><span style=\"font-size: 1rem;\"> – A great way to engage guests and capture lasting memories</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1052\" data-end=\"1071\" style=\"font-size: 1rem;\">Instant sharing</strong><span style=\"font-size: 1rem;\"> – Quick sharing options for social media</span></div></p><p data-start=\"1116\" data-end=\"1264\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Make your event an unforgettable experience by offering guests the chance to <strong data-start=\"1193\" data-end=\"1225\">create their own cover story</strong>!&nbsp;</p>', 1, 'service-1740734269-26.png', '\"[null]\"', '[]', 'https://youtu.be/a9bfmh2Qg-c', 1, '2024-09-14 04:58:02', '2025-03-17 15:35:07'),
(27, 'SMART VENDING', 'smart-vending', 'Get a gift from vending machine by taking a photo, playing a game, or uploading the event tag.', '<span style=\"font-family: Tahoma;\">State of the art smart vending machines. Machine that gives reward for data, market research, social engagement. Touchscreen and touch-less vending machine that is full packed of experiential marketing technology to help brands bridge the gap to their audiences.</span>', 0, 'service-1726226319-18.jpg', '\"[null]\"', '[\"service-gallery-18-66e41f9010ae8.jpg\",\"service-gallery-18-66e41f9014586.jpg\",\"service-gallery-18-66e41f90183b6.jpg\"]', NULL, 2, '2024-09-11 08:26:27', '2025-02-28 18:27:51'),
(28, 'LIVE PRINTING', 'live-printing', 'With ring booth or DIY design screen. reate sublimated souvenir gift for the guests.', '<p><font color=\"#000000\"><span class=\"x-el x-el-span c1-1n c1-1o c1-b c1-7v c1-35 c1-7w c1-7x\" style=\"box-sizing: inherit; font-family: Arial; font-size: 24px; font-weight: 700; line-height: inherit;\">Live event printing&nbsp;</span><span style=\"font-family: Arial; font-size: 24px;\">for event activation Ideas for trade shows | Event T-Shirt, Acrylic, Mugs, Tote Bags, and many more.</span></font><br></p>', 0, 'service-1726221962-19.jpg', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/1Sit1ARbMZQ\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/zv-VnOuyAB4\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/2SJD5QHdoho\\\"]\"', '[\"service-gallery-19-66e40e8ab90df.jpg\",\"service-gallery-19-66e40e8ad3f4d.jpg\",\"service-gallery-19-66e40e8b6858c.jpg\",\"service-gallery-19-66e40e8bf4034.jpg\",\"service-gallery-19-66e40e8c0763c.jpg\",\"service-gallery-19-66e40e8c0bc1c.jpg\",\"service-gallery-19-66e40e8c0fe67.jpg\"]', 'https://www.youtube.com/watch?v=OWEkRY6ILFw', 2, '2024-09-11 08:27:12', '2025-03-01 16:08:12'),
(29, 'MOTION GAMES', 'motion-games', 'With ring booth or DIY design screen. reate sublimated souvenir gift for the guests.', '<p><span style=\"font-family: Arial; font-size: 24px;\"><font color=\"#000000\">Branded motion sensor game, Various brand or event elements fly around on screen and players have to use their body and arms to try and slash them all to gain points while they are also avoiding negative obstacles within a 60 second timer.&nbsp;</font></span><br></p>', 0, 'service-1726226407-20.jpg', '\"[null]\"', '[]', 'https://youtu.be/JmzyPhYUpxI', 2, '2024-09-11 08:27:45', '2025-03-01 16:22:35'),
(30, 'LIGHT PAINTING', 'light-painting', 'Custom neon designs for your event, with instant prints and sharing.', '<p data-start=\"369\" data-end=\"450\" style=\"text-align: justify; \"><strong data-start=\"374\" data-end=\"444\">Neon Light Paint Booth – Unleash Vibrant Creativity at Your Event!</strong>&nbsp;</p><p data-start=\"452\" data-end=\"914\" style=\"text-align: justify; \">Illuminate your event with the <strong data-start=\"483\" data-end=\"509\">Neon Light Paint Booth</strong>, where glowing neon lights create mesmerizing, colorful designs in every photo. Using <strong data-start=\"596\" data-end=\"623\">electrified glass tubes</strong> or bulbs filled with <strong data-start=\"645\" data-end=\"662\">rarefied neon</strong> gases, this interactive experience offers both <strong data-start=\"710\" data-end=\"727\">entertainment</strong> and <strong data-start=\"732\" data-end=\"752\">brand visibility</strong>. Guests will love the unique, vivid effects on their photos, and you’ll enjoy the endless <strong data-start=\"843\" data-end=\"869\">branding possibilities</strong> as their neon creations light up the room.</p><p data-start=\"916\" data-end=\"1280\"></p><div style=\"text-align: justify;\"><strong data-start=\"919\" data-end=\"961\" style=\"font-size: 1rem;\">Why Choose the Neon Light Paint Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"966\" data-end=\"997\" style=\"font-size: 1rem;\">Stunning neon light effects</strong><span style=\"font-size: 1rem;\"> – Create glowing, artistic photos that pop</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1045\" data-end=\"1078\" style=\"font-size: 1rem;\">Perfect for brand activations</strong><span style=\"font-size: 1rem;\"> – Customize the lighting and design to match&nbsp;</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1139\" data-end=\"1161\" style=\"font-size: 1rem;\">Engage your guests</strong><span style=\"font-size: 1rem;\"> – Fun, creative experience with lasting memories</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1215\" data-end=\"1239\" style=\"font-size: 1rem;\">Instant shareability</strong><span style=\"font-size: 1rem;\"> – Quick, easy sharing for social media</span></div><p></p><p data-start=\"1282\" data-end=\"1446\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Bring a touch of <strong data-start=\"1299\" data-end=\"1323\">creativity and color</strong> to your event while enhancing your <strong data-start=\"1359\" data-end=\"1377\">brand presence</strong> with the <strong data-start=\"1387\" data-end=\"1413\">Neon Light Paint Booth</strong>!</p>', 1, 'service-54.jpg', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/-TKXNTjeU18\\\"]\"', '[\"service-gallery-54-66e4163ddf549.jpg\",\"service-gallery-54-66e4163dedd1d.jpg\",\"service-gallery-54-66e4163e10cca.jpg\"]', 'https://youtu.be/8LdN0LZe9zA', 1, '2024-09-14 05:38:53', '2025-03-05 15:05:26'),
(31, 'CLICK AND PRINT', 'click-and-print', 'Instant photos and prints with professional photography and event branding.', '<p data-start=\"343\" data-end=\"421\" style=\"text-align: justify; \"><strong data-start=\"347\" data-end=\"413\">Instant Click &amp; Print – Professional Photos, Instant Memories!</strong>&nbsp;</p><p data-start=\"423\" data-end=\"830\" style=\"text-align: justify;\">Make every moment unforgettable with our <strong data-start=\"464\" data-end=\"489\">Instant Click &amp; Print</strong> service! Our professional photographer captures high-quality photos using top-tier equipment, while our instant printing system produces branded photographs on-site. Whether it’s for <strong data-start=\"673\" data-end=\"693\">corporate events</strong>, <strong data-start=\"695\" data-end=\"716\">brand activations</strong>, or <strong data-start=\"721\" data-end=\"742\">special occasions</strong>, this service offers an engaging experience with immediate keepsakes for your guests.</p><p data-start=\"832\" data-end=\"1180\"><div style=\"text-align: justify;\"><strong data-start=\"835\" data-end=\"872\" style=\"font-size: 1rem;\">Why Choose Instant Click &amp; Print?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"877\" data-end=\"900\" style=\"font-size: 1rem;\">Professional photos</strong><span style=\"font-size: 1rem;\"> – Captured by expert photographers with high-quality equipment</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"968\" data-end=\"988\" style=\"font-size: 1rem;\">Instant printing</strong><span style=\"font-size: 1rem;\"> – Branded event photos printed on the spot</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1036\" data-end=\"1059\" style=\"font-size: 1rem;\">Engaging experience</strong><span style=\"font-size: 1rem;\"> – Instant memories your guests can take home</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1109\" data-end=\"1133\" style=\"font-size: 1rem;\">Branding opportunity</strong><span style=\"font-size: 1rem;\"> – Your event branding featured on each photo</span></div></p><p data-start=\"1182\" data-end=\"1327\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify;\">Make your event extra special with <strong data-start=\"1217\" data-end=\"1242\">Instant Click &amp; Print</strong>—because every moment deserves to be remembered!&nbsp;</p>', 1, 'service-1741088261-31.jpg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=kLLlLsK_ZV8\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=M3wkWs9BU2E\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=yt8gPeMC444\\\"]\"', '[\"service-gallery-55-66e417419f304.jpg\",\"service-gallery-55-66e41741b6714.jpg\",\"service-gallery-55-66e41741ce76c.jpg\"]', 'https://youtu.be/ow442hB_xdo', 1, '2024-09-14 05:43:13', '2025-03-04 18:37:58'),
(32, 'MAGNET BOOTH', 'magnet-booth', 'Instant photo prints on magnetic paper with our photobooth.', '<p data-start=\"397\" data-end=\"696\" style=\"text-align: justify; \"><span data-start=\"447\" data-end=\"469\" style=\"font-weight: bolder;\">Magnet Photo Booth</span></p><p data-start=\"397\" data-end=\"696\" style=\"text-align: justify; \">Make your trade show booth unforgettable with our <strong data-start=\"447\" data-end=\"469\">Magnet Photo Booth</strong>! It’s the perfect way to engage attendees and create lasting branded giveaways. As guests step up for their photo, they’ll instantly receive a personalized photo magnet, making your brand memorable long after the event ends.</p><p data-start=\"698\" data-end=\"960\" style=\"text-align: justify;\">Our professional team works as an extension of yours, ensuring smooth operation and encouraging traffic to your booth. These magnetic keepsakes not only capture moments but also create valuable opportunities for your sales team to connect with potential leads.</p><p data-start=\"962\" data-end=\"1218\"></p><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">🔥 </span><strong data-start=\"965\" data-end=\"999\" style=\"font-size: 1rem;\">Why Choose Magnet Photo Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1004\" data-end=\"1029\" style=\"font-size: 1rem;\">Instant photo magnets</strong><span style=\"font-size: 1rem;\"> – A personalized takeaway for every guest.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1077\" data-end=\"1097\" style=\"font-size: 1rem;\">Brand engagement</strong><span style=\"font-size: 1rem;\"> – A memorable branded giveaway that lasts.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1145\" data-end=\"1164\" style=\"font-size: 1rem;\">Lead generation</strong><span style=\"font-size: 1rem;\"> – Boost traffic and connect with potential clients.</span></div><p></p><p data-start=\"1220\" data-end=\"1383\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Stand out at your next event and create lasting impressions with <strong data-start=\"1285\" data-end=\"1307\">Magnet Photo Booth</strong>—the giveaway that attendees will keep!&nbsp;</p>', 1, 'service-56.jpg', '\"[null,null]\"', '[\"service-gallery-32-67c6ec9bdfa95.jpg\",\"service-gallery-32-67c6ec9c3d04e.jpg\"]', 'https://youtu.be/0P9BYca_41A', 4, '2024-09-14 05:44:58', '2025-03-05 18:22:18'),
(33, 'AI SKETCH BOOTH', 'ai-sketch-booth', 'Transforms visitor\'s standard snapshot into an artistic drawing using AI technology.', '<p data-start=\"364\" data-end=\"442\" style=\"text-align: justify; \"><strong data-start=\"369\" data-end=\"438\">AI Sketch Booth – Revolutionizing Event Portraits with AI!</strong>&nbsp;</p><p data-start=\"444\" data-end=\"853\" style=\"text-align: justify; \">Want to offer your guests the fun of a sketch artist without the wait? Our&nbsp;<span data-start=\"369\" data-end=\"438\" style=\"font-weight: bolder;\">AI Sketch Booth</span>&nbsp;photobooth is the perfect solution! Powered by cutting-edge <strong data-start=\"606\" data-end=\"623\">AI technology</strong>, it creates stunning, personalized sketches instantly. With options like <strong data-start=\"697\" data-end=\"718\">Avatar generation</strong>, <strong data-start=\"720\" data-end=\"738\">Beauty Enhance</strong>, and other creative AI features, your guests can enjoy a one-of-a-kind portrait that’s fast, fun, and shareable!</p><p data-start=\"855\" data-end=\"1228\"><div style=\"text-align: justify;\"><strong data-start=\"858\" data-end=\"900\" style=\"font-size: 1rem;\">Why Choose the AI Robot Sketch Artist?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"905\" data-end=\"926\" style=\"font-size: 1rem;\">Instant portraits</strong><span style=\"font-size: 1rem;\"> – Faster than traditional sketch artists, no long waits</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"987\" data-end=\"1012\" style=\"font-size: 1rem;\">Customizable features</strong><span style=\"font-size: 1rem;\"> – Avatar, Beauty Enhance, and other AI options</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1064\" data-end=\"1087\" style=\"font-size: 1rem;\">Engaging experience</strong><span style=\"font-size: 1rem;\"> – Unique, personalized portraits that guests love</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1142\" data-end=\"1166\" style=\"font-size: 1rem;\">Branding opportunity</strong><span style=\"font-size: 1rem;\"> – Your event branding can be incorporated into the sketches</span></div></p><p data-start=\"1230\" data-end=\"1398\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Take your event to the next level with the <strong data-start=\"1273\" data-end=\"1299\">AI Robot Sketch Artist</strong>—combining creativity, speed, and branding in one exciting experience!&nbsp;</p>', 1, 'service-57.jpg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=YbmaMFJE4Ow\\\"]\"', '[\"service-gallery-57-66e418aeb8ecc.jpg\",\"service-gallery-57-66e418aebe7cd.jpg\",\"service-gallery-57-66e418aec3c31.jpg\"]', 'https://youtu.be/EBGKbe6cOVs', 1, '2024-09-14 05:49:18', '2025-03-04 18:40:39'),
(34, 'TEXT SELFIE', 'text-selfie', 'Text Selfies incorporates event text branding into the images of guests.', '<p>This is a fantastic addition to any event, offering a new and fun alternative to the standard photo booth. YOUR TEXT - YOUR IMAGERY. With our text selfie photo booth, we create stunning selfies entirely from your own word content. Completely customizable, with email and printing options.<br></p>', 0, 'service-58.jpg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=DCBn9NQU6FA\\\"]\"', '[\"service-gallery-58-66e4192e0c6dc.jpg\",\"service-gallery-58-66e4192e1e8b1.jpg\",\"service-gallery-58-66e4192e32aef.jpg\"]', 'https://youtu.be/aABodTihKYo', 1, '2024-09-14 05:51:25', '2025-02-28 21:28:23'),
(35, 'GRAFFITI TOUCH', 'graffiti-touch', 'Customize your pictures with emojis, branding, text, and all kinds of custom effects.', '<p data-start=\"370\" data-end=\"450\" style=\"text-align: justify; \"><strong data-start=\"374\" data-end=\"443\">Interactive Graffiti Touch – A Canvas for Your Guests’ Creativity!</strong>&nbsp;</p><p data-start=\"452\" data-end=\"863\" style=\"text-align: justify;\">Our&nbsp;<span data-start=\"374\" data-end=\"443\" style=\"font-weight: bolder;\">Interactive Graffiti Touch</span>&nbsp;takes guest engagement to the next level with a touchscreen that lets them create art instantly! Whether using their fingers or a graffiti-style marker, guests can immerse themselves in a fun, hands-on experience, making it a perfect icebreaker at any event. The wall is fully <strong data-start=\"763\" data-end=\"776\">brandable</strong>, and its <strong data-start=\"786\" data-end=\"808\">interactive nature</strong> sparks curiosity, ensuring your crowd stays engaged.</p><p data-start=\"865\" data-end=\"1189\"></p><div style=\"text-align: justify;\"><strong data-start=\"868\" data-end=\"913\" style=\"font-size: 1rem;\">Why Choose the Interactive Graffiti Wall?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"918\" data-end=\"944\" style=\"font-size: 1rem;\">Interactive experience</strong><span style=\"font-size: 1rem;\"> – Guests create their own art on the touchscreen</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"998\" data-end=\"1011\" style=\"font-size: 1rem;\">Brandable</strong><span style=\"font-size: 1rem;\"> – Customizable with your event branding or logos</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1065\" data-end=\"1077\" style=\"font-size: 1rem;\">Engaging</strong><span style=\"font-size: 1rem;\"> – Keeps the crowd involved and sparks creativity</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1131\" data-end=\"1146\" style=\"font-size: 1rem;\">Fun for all</strong><span style=\"font-size: 1rem;\"> – Suitable for all ages and skill levels</span></div><p></p><p data-start=\"1191\" data-end=\"1370\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify;\">Bring your event to life with the <strong data-start=\"1225\" data-end=\"1254\">Interactive Graffiti Wall</strong>—a dynamic way to connect, engage, and showcase creativity at your event!&nbsp;</p>', 1, 'service-1740825608-35.jpg', '\"[null]\"', '[]', 'https://youtu.be/0o16IRPHkek', 1, '2024-09-14 05:55:28', '2025-03-04 18:44:29'),
(36, 'FLIP BOOK', 'flip-book', 'Turn guests\' videos into images, flip through them in an interactive flipbook.', '<p data-start=\"286\" data-end=\"353\" style=\"text-align: justify; \"><strong data-start=\"291\" data-end=\"346\">Flip Book – A Personalized, Interactive Experience!</strong>&nbsp;</p><p data-start=\"355\" data-end=\"658\" style=\"text-align: justify;\">Make your event unforgettable with our <strong data-start=\"394\" data-end=\"407\">Flip Book</strong>! A short video clip is turned into a series of images that gradually change as guests flip through the book. It\'s an engaging and creative way to relive event moments, and it\'s fully customizable with a cover that matches your event theme or brand.</p><p data-start=\"660\" data-end=\"867\" style=\"text-align: justify;\">The <strong data-start=\"664\" data-end=\"677\">Flip Book</strong> offers a fun and interactive way to give guests a unique keepsake that they can cherish long after the event. Each flip brings a new image to life, capturing the excitement of the moment.</p><p data-start=\"869\" data-end=\"1102\"><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"872\" data-end=\"897\" style=\"font-size: 1rem;\">Why Choose Flip Book?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"902\" data-end=\"924\" style=\"font-size: 1rem;\">Customizable cover</strong><span style=\"font-size: 1rem;\"> – Align with your event theme or brand.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"969\" data-end=\"993\" style=\"font-size: 1rem;\">Interactive keepsake</strong><span style=\"font-size: 1rem;\"> – A fun way to relive memories.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1030\" data-end=\"1044\" style=\"font-size: 1rem;\">Engagement</strong><span style=\"font-size: 1rem;\"> – Keeps guests entertained and connected to your brand.</span></div></p><p data-start=\"1104\" data-end=\"1286\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Create a memorable, personalized experience with a <strong data-start=\"1155\" data-end=\"1168\">Flip Book</strong> at your next event, ensuring your brand stands out in the most creative way!&nbsp;</p>', 1, 'service-1740733966-36.jpeg', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/Vpt5gemiTjI\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/3CO7S5_DlIo\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=BNcFnor9EiY\\\"]\"', '[\"service-gallery-36-67c17e0eb1a08.jpg\",\"service-gallery-36-67c17e0eb7a14.jpg\",\"service-gallery-36-67c17e0ebfd68.jpeg\"]', 'https://www.youtube.com/watch?v=quldsKjQUJg', 4, '2024-10-25 15:51:08', '2025-03-05 15:16:12');
INSERT INTO `services` (`id`, `name`, `slug`, `short_desc`, `description`, `status`, `image`, `additional_videos_links`, `gallery_images`, `videos_link`, `category_id`, `created_at`, `updated_at`) VALUES
(37, 'HYBRID MOSAIC', 'hybrid-mosaic', 'Create a digital photo mosaic, engage guests globally, and celebrate togetherness.', '<p data-start=\"423\" data-end=\"501\" style=\"text-align: justify; \"><strong data-start=\"427\" data-end=\"499\">Virtual &amp; Hybrid Mosaic – Connecting Your Guests, Anytime, Anywhere!</strong>&nbsp;</p><p data-start=\"503\" data-end=\"895\" style=\"text-align: justify;\">Bring your guests together, no matter where they are, with our <strong data-start=\"566\" data-end=\"593\">Virtual &amp; Hybrid Mosaic</strong> experience! Perfect for <strong data-start=\"618\" data-end=\"636\">virtual events</strong>, this interactive digital photo mosaic allows guests to contribute their photos and become part of a larger, meaningful work of art. Collect <strong data-start=\"778\" data-end=\"787\">leads</strong>, get <strong data-start=\"793\" data-end=\"805\">feedback</strong>, and create a buzz by encouraging attendees to share their contributions on social media.</p><p data-start=\"897\" data-end=\"1383\"><div style=\"text-align: justify;\"><strong data-start=\"900\" data-end=\"943\" style=\"font-size: 1rem;\">Why Choose the Virtual &amp; Hybrid Mosaic?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"948\" data-end=\"972\" style=\"font-size: 1rem;\">Remote participation</strong><span style=\"font-size: 1rem;\"> – Engage guests from around the world</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1015\" data-end=\"1042\" style=\"font-size: 1rem;\">Interactive digital art</strong><span style=\"font-size: 1rem;\"> – Create a mosaic that reflects the “Bigger Picture” of your brand</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1114\" data-end=\"1142\" style=\"font-size: 1rem;\">Collect leads &amp; feedback</strong><span style=\"font-size: 1rem;\"> – Use guest participation to gather valuable insights</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1201\" data-end=\"1228\" style=\"font-size: 1rem;\">Social media engagement</strong><span style=\"font-size: 1rem;\"> – Let guests share their moments and build excitement</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1287\" data-end=\"1313\" style=\"font-size: 1rem;\">Celebrate togetherness</strong><span style=\"font-size: 1rem;\"> – Perfect for social distancing events, celebrating unity virtually</span></div></p><p data-start=\"1385\" data-end=\"1586\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Celebrate your brand’s impact and bring your event to life with the <strong data-start=\"1453\" data-end=\"1480\">Virtual &amp; Hybrid Mosaic</strong>—creating a digital masterpiece with every guest’s contribution!&nbsp;</p>', 1, 'service-1740733149-37.png', '\"[\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/1MUpC0w8_ew\\\",\\\"https:\\\\\\/\\\\\\/youtu.be\\\\\\/y2Yd9m89RC0\\\"]\"', '[\"service-gallery-37-67c17addebc06.jpg\"]', 'https://youtu.be/oKKnv3Il2N0', 1, '2024-10-25 16:47:26', '2025-03-17 15:37:29'),
(38, 'SCREAM GAME', 'scream-game-2', 'Engages crowds with sound, offering customizable mechanics for activations.', '<h3 data-start=\"0\" data-end=\"73\" style=\"text-align: justify; \"><span data-start=\"372\" data-end=\"441\" style=\"font-size: 1rem; font-weight: bolder;\">Interactive Scream Game</span></h3><p data-start=\"75\" data-end=\"410\" style=\"text-align: justify;\">Looking for a <strong data-start=\"89\" data-end=\"124\">high-energy, attention-grabbing</strong> game for your event? The <strong data-start=\"150\" data-end=\"177\">Interactive Scream Game</strong> is designed to <strong data-start=\"193\" data-end=\"209\" data-is-only-node=\"\">gamify sound</strong> and turn audience participation into an exciting experience! Whether it\'s for <strong data-start=\"288\" data-end=\"349\">brand activations, pop-up events, or corporate gatherings</strong>, this game guarantees <strong data-start=\"372\" data-end=\"408\">fun, excitement, and engagement.</strong></p><p data-start=\"412\" data-end=\"651\"></p><div style=\"text-align: justify;\"><strong data-start=\"415\" data-end=\"432\" style=\"font-size: 1rem;\">How It Works:</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Players </span><strong data-start=\"443\" data-end=\"475\" style=\"font-size: 1rem;\">scream, shout, or make noise</strong><span style=\"font-size: 1rem;\"> to control the game! The louder they get, the further they progress. The </span><strong data-start=\"549\" data-end=\"590\" style=\"font-size: 1rem;\">game mechanics are fully customizable</strong><span style=\"font-size: 1rem;\"> to match your brand, event theme, or marketing objectives.</span></div><p></p><p data-start=\"653\" data-end=\"996\"></p><div style=\"text-align: justify;\"><strong data-start=\"655\" data-end=\"686\" style=\"font-size: 1rem;\">Why Choose the Scream Game?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"691\" data-end=\"712\" style=\"font-size: 1rem;\">Interactive &amp; Fun</strong><span style=\"font-size: 1rem;\"> – Encourages crowd participation.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"751\" data-end=\"767\" style=\"font-size: 1rem;\">Customizable</strong><span style=\"font-size: 1rem;\"> – Adapt the game to fit your branding and campaign goals.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"830\" data-end=\"853\" style=\"font-size: 1rem;\">Engaging &amp; Exciting</strong><span style=\"font-size: 1rem;\"> – Creates a high-energy atmosphere at any event.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"907\" data-end=\"940\" style=\"font-size: 1rem;\">Perfect for Brand Activations</strong><span style=\"font-size: 1rem;\"> – Draws attention and maximizes audience interaction.</span></div><p></p>', 1, 'service-1740734537-38.jpg', '\"[null]\"', '[\"service-gallery-62-671f83764664c.jpg\",\"service-gallery-62-671f837647b0e.jpg\",\"service-gallery-62-671f837648dd8.jpg\"]', 'https://www.youtube.com/watch?v=g05RCkpu-ZQ', 2, '2024-10-29 17:29:55', '2025-03-05 15:26:29'),
(39, 'CATCH THE LETTER', 'catch-the-letter-2', 'Capture everyone’s attention and create a fun and interactive experience.', '<p data-start=\"338\" data-end=\"415\" style=\"text-align: justify;\"><span data-start=\"342\" data-end=\"410\" style=\"font-weight: bolder;\">Catch The Letter - Interactive Word Recognition Game</span></p><p data-start=\"338\" data-end=\"415\" style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Looking for <b>a fun and educational interactive game</b> for your event?<b> Catch the letter</b>! challenges players to catch specific words or phrases on the screen by pressing the catch button at just the right moment. This is perfect for testing reaction time, word recognition, and precision.&nbsp;</span></p><p data-start=\"338\" data-end=\"415\" style=\"text-align: justify;\"><span style=\"font-size: 1rem; font-weight: bolder;\">Why Choose&nbsp;</span><span style=\"font-weight: 700;\">Catch The Letter</span><span style=\"font-size: 1rem; font-weight: bolder;\">?</span></p><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅<b> Available in Arabic &amp; English</b> - Perfect for diverse audiences</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ <b>Customizable Brandin</b>g - Add your logo, themes, and phrases.&nbsp;</span></div><div style=\"text-align: justify;\"><br></div>', 1, 'service-1740734738-39.jpg', '\"[null]\"', '[]', 'https://www.youtube.com/watch?v=cCmECnZkVyY', 2, '2024-10-29 17:32:46', '2025-03-05 15:44:55'),
(40, 'AI RING ROAMER', 'ai-ring-roamer', 'Expert photography with AI for endless themed picture experiences.', '<p data-start=\"419\" data-end=\"483\" style=\"text-align: justify; \"><strong data-start=\"423\" data-end=\"481\">AI Ring Roamer Photo Booth – Unleash the Fun Anywhere!</strong>&nbsp;</p><p data-start=\"485\" data-end=\"780\" style=\"text-align: justify; \">Introducing our <strong data-start=\"572\" data-end=\"602\">AI Ring Roamer Photo Booth</strong>, a mobile photo booth experience that combines <strong data-start=\"650\" data-end=\"677\">Artificial Intelligence</strong> with creative photo themes, giving your guests the freedom to have fun throughout your entire event.&nbsp;<span style=\"font-size: 1rem;\">Transform your guests into anything from </span><strong data-start=\"823\" data-end=\"838\" style=\"font-size: 1rem;\">movie stars</strong><span style=\"font-size: 1rem;\"> to </span><strong data-start=\"842\" data-end=\"857\" style=\"font-size: 1rem;\">superheroes</strong><span style=\"font-size: 1rem;\">, </span><strong data-start=\"859\" data-end=\"870\" style=\"font-size: 1rem;\">zombies</strong><span style=\"font-size: 1rem;\"> to </span><strong data-start=\"874\" data-end=\"890\" style=\"font-size: 1rem;\">sports stars</strong><span style=\"font-size: 1rem;\">, and much more. Choose from our existing themes or work with our team to create a custom experience unique to your event or brand.</span></p><p data-start=\"1025\" data-end=\"1424\"></p><div style=\"text-align: justify;\"><strong data-start=\"1028\" data-end=\"1074\" style=\"font-size: 1rem;\">Why Choose the AI Ring Roamer Photo Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1079\" data-end=\"1100\" style=\"font-size: 1rem;\">Mobile &amp; portable</strong><span style=\"font-size: 1rem;\"> – Bring the photo booth wherever the action is!</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1153\" data-end=\"1173\" style=\"font-size: 1rem;\">AI-powered magic</strong><span style=\"font-size: 1rem;\"> – Turn guests into any persona or character imaginable.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1234\" data-end=\"1251\" style=\"font-size: 1rem;\">Custom themes</strong><span style=\"font-size: 1rem;\"> – Tailor the experience to your event with exclusive themes.</span></div><p></p><p data-start=\"1426\" data-end=\"1567\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Make your event an adventure with the <strong data-start=\"1464\" data-end=\"1494\">AI Ring Roamer Photo Booth</strong>, and let your guests’ imaginations run wild!&nbsp;</p>', 1, 'service-1740731277-40.jpg', '\"[null]\"', '[]', 'https://www.youtube.com/watch?v=TbuaOhBQW9U', 1, '2024-10-29 19:14:25', '2025-03-17 15:35:55'),
(41, 'GUESS THE ICON', 'guess-the-icon', 'Guess - hazards and emergency signs for your staff’s awareness and care.', '<h3 data-start=\"0\" data-end=\"77\" style=\"text-align: justify; \"><span style=\"font-size: 1rem; font-weight: bolder;\">Guess the Safety Icon</span></h3><div style=\"text-align: justify;\"><h5 class=\"\" style=\"margin-right: 0px; margin-left: 0px; font-family: Roboto, sans-serif; color: rgb(111, 139, 164); padding: 0px; text-align: center;\"><div style=\"margin: 0px; padding: 0px; text-align: justify;\"><span data-start=\"333\" data-end=\"350\" style=\"font-weight: bolder; color: rgb(33, 37, 41); font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 1rem;\">How It Works:</span></div></h5><div><span style=\"font-size: 1rem;\">Participants are shown a series of&nbsp;</span><span data-start=\"388\" data-end=\"404\" style=\"font-weight: bolder; font-size: 1rem;\">safety icons</span><span style=\"font-size: 1rem;\">&nbsp;like hazard symbols, emergency signs, or protective equipment symbols. They must then&nbsp;</span><span data-start=\"491\" data-end=\"526\" style=\"font-weight: bolder; font-size: 1rem;\">guess what each icon represents</span><span style=\"font-size: 1rem;\">&nbsp;in order to score points. This exciting game is perfect for promoting&nbsp;</span><span data-start=\"597\" data-end=\"617\" style=\"font-weight: bolder; font-size: 1rem;\">safety education</span><span style=\"font-size: 1rem;\">&nbsp;at events and is&nbsp;</span><span data-start=\"635\" data-end=\"651\" style=\"font-weight: bolder; font-size: 1rem;\">customizable</span><span style=\"font-size: 1rem;\">&nbsp;to suit your brand or theme.</span></div><p style=\"text-align: left;\"></p><p data-start=\"684\" data-end=\"1110\" style=\"text-align: left;\"></p><div><span style=\"font-size: 1rem;\">&nbsp;</span><span data-start=\"686\" data-end=\"723\" style=\"font-weight: bolder; font-size: 1rem;\">Why Choose Guess the Safety Icon?</span></div><div><span style=\"font-size: 1rem;\">✅&nbsp;</span><span data-start=\"728\" data-end=\"752\" style=\"font-weight: bolder; font-size: 1rem;\">Customizable Content</span><span style=\"font-size: 1rem;\">&nbsp;– Tailor the icons and branding to your event or industry.</span></div><div><span style=\"font-size: 1rem;\">✅&nbsp;</span><span data-start=\"816\" data-end=\"837\" style=\"font-weight: bolder; font-size: 1rem;\">Educational &amp; Fun</span><span style=\"font-size: 1rem;\">&nbsp;– Raise awareness about safety in an interactive way.</span></div><div><span style=\"font-size: 1rem;\">✅&nbsp;</span><span data-start=\"896\" data-end=\"938\" style=\"font-weight: bolder; font-size: 1rem;\">Perfect for Corporate or Public Events</span><span style=\"font-size: 1rem;\">&nbsp;– Ideal for exhibitions, safety training, and community outreach.</span></div><div><span style=\"font-size: 1rem;\">✅&nbsp;</span><span data-start=\"1009\" data-end=\"1034\" style=\"font-weight: bolder; font-size: 1rem;\">Engaging for All Ages</span><span style=\"font-size: 1rem;\">&nbsp;– Encourages participation while educating on important safety protocols.</span></div><p style=\"text-align: left;\"></p><p data-start=\"1112\" data-end=\"1244\" style=\"text-align: left;\"></p><div><span data-start=\"1249\" data-end=\"1308\" style=\"font-weight: bolder; font-size: 1rem;\">Raise awareness about safety in a fun and engaging way!</span><span style=\"font-size: 1rem;\">&nbsp;Book&nbsp;</span><span data-start=\"1314\" data-end=\"1339\" style=\"font-weight: bolder; font-size: 1rem;\">Guess the Safety Icon</span><span style=\"font-size: 1rem;\">&nbsp;today and help your guests learn while they play!&nbsp;</span></div></div><p></p>', 1, 'service-1740734847-41.jpg', '\"[null]\"', '[]', 'https://www.youtube.com/watch?v=Nj1nUP7d5_A', 2, '2024-10-29 19:22:28', '2025-03-17 15:51:54'),
(42, 'BATAK CHALLENGE', 'batak-challenge', 'Boost engagement with the Batak Challenge Dubai—fast, fun, and brand-powered.', '<div class=\"flex max-w-full flex-col flex-grow\"><div data-message-author-role=\"assistant\" data-message-id=\"5749b3c7-b51d-4254-9fe1-65b63a4da9e6\" dir=\"auto\" class=\"min-h-8 text-message relative flex w-full flex-col items-end gap-2 whitespace-normal break-words text-start [.text-message+&amp;]:mt-5\" data-message-model-slug=\"gpt-4o-mini\"><div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\"><div class=\"markdown prose w-full break-words dark:prose-invert dark\"><h3 data-start=\"0\" data-end=\"63\" style=\"text-align: justify; \"><span data-start=\"342\" data-end=\"410\" style=\"font-size: 1rem; font-weight: bolder;\">Batak Challenge - Reflex Test Game</span></h3><p data-start=\"65\" data-end=\"326\" style=\"text-align: justify; \">The <strong data-start=\"69\" data-end=\"88\">Batak Challenge</strong> is the ultimate interactive game to test your reflexes and have fun! Perfect for <strong data-start=\"170\" data-end=\"190\">corporate events</strong>, <strong data-start=\"192\" data-end=\"203\">parties</strong>, or <strong data-start=\"208\" data-end=\"236\">team-building activities</strong>, this fast-paced game challenges players to hit lights as they light up across a panel.</p><p data-start=\"328\" data-end=\"437\"></p><div style=\"text-align: justify;\"><strong data-start=\"331\" data-end=\"352\" style=\"font-size: 1rem;\">Why Choose Batak?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"357\" data-end=\"379\" data-is-only-node=\"\" style=\"font-size: 1rem;\">Great for all ages</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"410\" data-end=\"435\" style=\"font-size: 1rem;\">Perfect for any event</strong></div><p></p><p data-start=\"439\" data-end=\"518\" style=\"text-align: justify; \"><strong data-start=\"523\" data-end=\"535\" style=\"font-size: 1rem;\">Book now</strong><span style=\"font-size: 1rem;\"> for an unforgettable experience!&nbsp;</span></p></div></div></div></div>', 1, 'service-1740736533-42.jpeg', '\"[null]\"', '[]', 'https://www.youtube.com/watch?v=WAnbJpiWphs', 2, '2025-02-28 16:53:01', '2025-03-05 15:48:29'),
(43, 'MINI PHOTO BOOTH', 'mini-photo-booth-2', 'Display your logo on an LED TV with unlimited prints and custom overlays.', '<p data-start=\"405\" data-end=\"482\" style=\"text-align: justify; \">&nbsp;<strong data-start=\"409\" data-end=\"480\">Mini Photo Booth with LED TV – Compact, Customizable &amp; Captivating!</strong>&nbsp;</p><p data-start=\"484\" data-end=\"712\" style=\"text-align: justify;\">Take your event to the next level with our <strong data-start=\"527\" data-end=\"559\">Mini Photo Booth with LED TV</strong>! No need for sticker branding—your event’s <strong data-start=\"603\" data-end=\"611\">logo</strong> or <strong data-start=\"615\" data-end=\"624\">theme</strong> is displayed seamlessly on the built-in LED TV, keeping things sleek and professional.&nbsp;<span style=\"font-size: 1rem;\">Enjoy the same amazing photo booth experience with </span><strong data-start=\"765\" data-end=\"791\" style=\"font-size: 1rem;\">unlimited photo prints</strong><span style=\"font-size: 1rem;\"> and </span><strong data-start=\"796\" data-end=\"821\" style=\"font-size: 1rem;\">personalized overlays</strong><span style=\"font-size: 1rem;\"> that reflect your unique branding. This compact solution delivers big impact, ensuring your event is both engaging and memorable.</span></p><p data-start=\"953\" data-end=\"1385\"></p><div style=\"text-align: justify;\"><strong data-start=\"956\" data-end=\"1004\" style=\"font-size: 1rem;\">Why Choose the Mini Photo Booth with LED TV?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1009\" data-end=\"1027\" style=\"font-size: 1rem;\">Sleek branding</strong><span style=\"font-size: 1rem;\"> – Showcase your logo or theme directly on the LED TV.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1086\" data-end=\"1112\" style=\"font-size: 1rem;\">Unlimited photo prints</strong><span style=\"font-size: 1rem;\"> – Guests get instant keepsakes with personalized overlays.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1293\" data-end=\"1320\" style=\"font-size: 1rem;\">Memorable &amp; interactive</strong><span style=\"font-size: 1rem;\"> – A fun and engaging photo booth experience.</span></div><p></p><p data-start=\"1387\" data-end=\"1543\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Enhance your event’s experience with the <strong data-start=\"1428\" data-end=\"1460\">Mini Photo Booth with LED TV</strong>—compact, customizable, and full of fun!</p>', 1, 'service-1740826109-43.jpg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=PGh6AbVKJ7s\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=tn586SV72Bg\\\"]\"', '[\"service-gallery-43-67c8078a92e15.jpg\"]', 'https://www.youtube.com/watch?v=C2vIFYUN2bg', 1, '2025-02-28 19:17:50', '2025-03-05 15:12:58'),
(44, 'PERFUME BOOTH', 'perfume-booth', NULL, NULL, 1, 'NULL', '[null]', NULL, NULL, 4, '2025-03-01 14:11:00', '2025-03-01 14:11:00'),
(45, 'BOXING MACHINE', 'boxing-machine', 'Test your strength with a punch boxing machine—fun, competitive, and thrilling!', '<h3 data-start=\"0\" data-end=\"56\" style=\"text-align: justify; \"><span data-start=\"342\" data-end=\"410\" style=\"font-size: 1rem; font-weight: bolder;\">Punch Boxing Machine - Test Your Strength!</span><span style=\"font-size: 1rem;\">&nbsp;</span></h3><p data-start=\"58\" data-end=\"411\" style=\"text-align: justify; \">Challenge your friends and test your punching power with our <strong data-start=\"119\" data-end=\"143\">Punch Boxing Machine</strong>! This thrilling arcade-style game measures the strength of your punch and gives you a score based on your impact. Whether you’re looking to show off your strength or just have fun, this exciting machine is perfect for <strong data-start=\"362\" data-end=\"373\">arcades</strong>, <strong data-start=\"375\" data-end=\"383\">bars</strong>, <strong data-start=\"385\" data-end=\"393\">gyms</strong>, and <strong data-start=\"399\" data-end=\"409\">events</strong>.</p><p data-start=\"413\" data-end=\"549\"></p><div style=\"text-align: justify;\"><strong data-start=\"416\" data-end=\"452\" style=\"font-size: 1rem;\">Why Choose Punch Boxing Machine?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Fun and competitive</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Suitable for all skill levels</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Thrilling high-energy experience</span></div><p></p><p data-start=\"551\" data-end=\"651\" style=\"text-align: justify; \"><strong data-start=\"656\" data-end=\"668\" style=\"font-size: 1rem;\">Book now</strong><span style=\"font-size: 1rem;\"> and bring the fun to your next event!</span></p>', 1, 'service-1740826994-45.jpg', '\"[null]\"', '[]', NULL, 2, '2025-03-01 14:19:13', '2025-03-17 15:53:18'),
(46, 'BOTTLE PRINTING', 'bottle-printing', 'Guests customize bottles live—boosting engagement and brand visibility.', '<p data-start=\"252\" data-end=\"340\" style=\"text-align: justify; \"><strong data-start=\"256\" data-end=\"332\">Onsite Bottle Printing – A Unique Branding Experience!</strong>&nbsp;</p><p data-start=\"342\" data-end=\"661\" style=\"text-align: justify;\">Turn ordinary bottles into personalized keepsakes with <strong data-start=\"397\" data-end=\"421\">live onsite printing</strong>! Guests can customize bottles with names, messages, or designs, creating a <strong data-start=\"497\" data-end=\"521\">memorable experience</strong> while showcasing your brand. This interactive activity boosts engagement and ensures your logo stays in their hands long after the event.</p><p data-start=\"663\" data-end=\"865\" style=\"text-align: justify; \"><strong data-start=\"666\" data-end=\"697\">Why Onsite Bottle Printing?</strong></p><p data-start=\"663\" data-end=\"865\"><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Enhances brand visibility with a lasting impression</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Engages guests with a fun, creative activity</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Perfect for corporate events, activations, and giveaways</span></div></p><p data-start=\"867\" data-end=\"1023\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Let your brand flow with every sip—engage, personalize, and promote with <strong data-start=\"940\" data-end=\"966\">Onsite Bottle Printing</strong>!&nbsp;</p>', 1, 'service-1741080132-46.jpg', '\"[null]\"', '[\"service-gallery-46-67c6c64501411.jpg\"]', 'https://www.youtube.com/watch?v=1Sit1ARbMZQ', 4, '2025-03-01 16:03:40', '2025-03-05 18:24:21'),
(47, 'MUG PRINTING', 'mug-printing', 'Design custom mugs live, providing keepsakes that reinforce your brand!', '<p data-start=\"323\" data-end=\"393\" style=\"text-align: justify; \"><strong data-start=\"327\" data-end=\"387\">Live Mug Printing – A Personalized Touch for Your Brand!</strong>&nbsp;</p><p data-start=\"395\" data-end=\"750\" style=\"text-align: justify;\">Take your brand activation to the next level with <strong data-start=\"445\" data-end=\"466\">Live Mug Printing</strong>! This interactive experience allows guests to create their own unique mugs, providing a fun and personal souvenir. Whether it\'s a corporate trade show or an engaging event activation, custom-designed mugs serve as a lasting reminder of your event and reinforce your brand identity.</p><p data-start=\"752\" data-end=\"995\" style=\"text-align: justify;\">By offering <strong data-start=\"764\" data-end=\"785\">personalized mugs</strong>, you give attendees a functional keepsake that they can use every day, keeping your brand visible long after the event ends. It’s a memorable, practical giveaway that ensures your business stays top of mind.</p><p data-start=\"997\" data-end=\"1251\"></p><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"1000\" data-end=\"1033\" style=\"font-size: 1rem;\">Why Choose Live Mug Printing?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1038\" data-end=\"1053\" style=\"font-size: 1rem;\">Custom mugs</strong><span style=\"font-size: 1rem;\"> – Personalize your brand experience for guests.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1106\" data-end=\"1129\" style=\"font-size: 1rem;\">Brand reinforcement</strong><span style=\"font-size: 1rem;\"> – A functional, branded keepsake.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1168\" data-end=\"1191\" style=\"font-size: 1rem;\">Long-term promotion</strong><span style=\"font-size: 1rem;\"> – Mugs continue to promote your business after the event.</span></div><p></p><p data-start=\"1253\" data-end=\"1434\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Create lasting impressions and elevate your brand’s presence with <strong data-start=\"1319\" data-end=\"1340\">Live Mug Printing</strong>—where personal touches meet powerful brand promotion!&nbsp;</p>', 1, 'service-1740829593-47.jpg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=BL43vOi3HCg\\\"]\"', '[\"service-gallery-47-67c2f39a26872.jpg\",\"service-gallery-47-67c2f4654ec19.jpg\"]', 'https://www.youtube.com/watch?v=sWt5HvPIuAs', 4, '2025-03-01 16:03:58', '2025-03-05 18:22:47'),
(48, 'T-SHIRT PRINTING', 't-shirt-printing', 'Create custom T-shirts live, offering fun experiences that boost brand value.', '<p>Offer guests a unique experience with <strong data-start=\"206\" data-end=\"237\">live event T-shirt printing</strong>! Perfect for trade shows, conventions, and exhibitions, this interactive activation allows attendees to design their own custom T-shirts on the spot. Whether it\'s for brand promotion or a fun keepsake, T-shirts printed live at the event create lasting memories while engaging visitors with your brand.</p>', 0, 'NULL', '\"[null]\"', '[]', NULL, 4, '2025-03-01 16:04:17', '2025-03-05 18:23:15'),
(49, 'TOTE BAG PRINTING', 'tote-bag-printing', 'Guests create custom totes—perfect for branding & engagement.', '<p style=\"text-align: justify;\"><strong data-start=\"321\" data-end=\"382\" style=\"font-size: 1rem;\">Onsite Tote Bag Printing – A Unique, Engaging Experience!</strong><span style=\"font-size: 1rem;\">&nbsp;</span></p><p style=\"text-align: justify;\">Make your event unforgettable with <strong data-start=\"426\" data-end=\"452\">live tote bag printing</strong>! Give your guests the chance to customize their own tote bags with unique designs, logos, or messages, creating a <strong data-start=\"567\" data-end=\"592\">personalized keepsake</strong> they’ll love. This interactive experience enhances brand engagement, making your event more <strong data-start=\"685\" data-end=\"723\">memorable, creative, and shareable</strong>.</p><p style=\"text-align: justify;\"><strong data-start=\"731\" data-end=\"764\">Why Onsite Tote Bag Printing?</strong></p><p></p><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Increases audience engagement &amp; interaction</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Provides a unique, branded giveaway</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Fun, creative, and Instagram-worthy experience</span></div><p></p><p style=\"text-align: justify;\">Turn your event into a hands-on branding opportunity and let your guests walk away with more than just memories—let them take your brand with them!&nbsp;</p>', 1, 'service-1741079173-49.jpg', '\"[null]\"', '[\"service-gallery-49-67c6c285d1468.jpg\"]', NULL, 4, '2025-03-01 16:04:37', '2025-03-05 18:24:02'),
(50, 'TRIVIA GAME', 'trivia-game', 'Engage attendees that promotes your brand in a fun, interactive way!', '<h3 data-start=\"0\" data-end=\"63\" style=\"text-align: justify; \"><span data-start=\"342\" data-end=\"410\" style=\"font-size: 1rem; font-weight: bolder;\">Trivia Game - Fun &amp; Brand Engagement!</span></h3><p data-start=\"65\" data-end=\"415\" style=\"text-align: justify;\">Engage your audience like never before with our <strong data-start=\"113\" data-end=\"140\">Interactive Trivia Game</strong>! A perfect blend of fun and brand promotion, this game is ideal for <strong data-start=\"209\" data-end=\"224\">trade shows</strong>, <strong data-start=\"226\" data-end=\"246\">corporate events</strong>, or <strong data-start=\"251\" data-end=\"274\">marketing campaigns</strong>. Participants can test their knowledge while learning about your products or industry, making it an educational experience they’ll remember.</p><p data-start=\"417\" data-end=\"589\"></p><div style=\"text-align: justify;\"><strong data-start=\"420\" data-end=\"451\" style=\"font-size: 1rem;\">Why Choose the Trivia Game?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Boost brand awareness</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Increase audience interaction</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Fun and educational for all</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Customizable to fit your brand or theme</span></div><p></p><p data-start=\"591\" data-end=\"712\" style=\"text-align: justify; \"><strong data-start=\"717\" data-end=\"741\" style=\"font-size: 1rem;\">Book the Trivia Game</strong><span style=\"font-size: 1rem;\"> and turn your event into an exciting, interactive learning experience!</span></p>', 1, 'service-1741078398-50.jpg', '\"[null]\"', '[\"service-gallery-50-67c6bf7e75ac9.jpg\"]', 'https://www.youtube.com/watch?v=uqrUm0iWkbU', 2, '2025-03-01 16:09:33', '2025-03-17 15:54:28'),
(51, 'SERVICE AWARD', 'service-award', 'Create excitement with our Service Award Interactive Game.', '<h3 data-start=\"0\" data-end=\"76\" style=\"text-align: justify; \"><span data-start=\"342\" data-end=\"410\" style=\"font-size: 1rem; font-weight: bolder;\">Service Award Interactive Game</span></h3><p data-start=\"78\" data-end=\"519\" style=\"text-align: justify;\">Make your event truly special with our <strong data-start=\"117\" data-end=\"151\">Service Award Interactive Game</strong>, specially designed to bring excitement and engagement to your occasion! This customizable trivia game can include <strong data-start=\"267\" data-end=\"293\">personalized questions</strong>, <strong data-start=\"295\" data-end=\"305\">photos</strong>, and a <strong data-start=\"313\" data-end=\"327\">scoreboard</strong> with any information you want to feature about the players. Whether it’s a friendly competition or a fun way to highlight achievements, this game will create lasting memories for your guests.</p><p data-start=\"521\" data-end=\"817\"></p><div style=\"text-align: justify;\"><strong data-start=\"524\" data-end=\"574\" style=\"font-size: 1rem;\">Why Choose the Service Award Interactive Game?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Fully customizable to fit your theme and brand</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Great for engagement and competition</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Tailored to include specific questions, photos, and player info</span></div><div style=\"text-align: justify;\"><strong data-start=\"977\" data-end=\"1010\" style=\"font-size: 1rem;\"><br></strong></div><div style=\"text-align: justify;\"><strong data-start=\"977\" data-end=\"1010\" style=\"font-size: 1rem;\">Create your dream trivia game</strong><span style=\"font-size: 1rem;\"> with us, and watch your guests enjoy a fun and memorable experience at your event!</span></div><p></p>', 1, 'service-1741160465-51.jpeg', '\"[null]\"', '[]', 'https://www.youtube.com/watch?v=qYbJe5EVSLM', 2, '2025-03-01 16:09:56', '2025-03-17 15:55:48'),
