(54, 'RECHARGE STATION', 'recharge-station', NULL, NULL, 0, 'NULL', '\"[null]\"', '[]', NULL, 2, '2025-03-01 16:12:43', '2025-03-01 18:27:48'),
(55, 'FOOTBALL CATCH', 'football-catch', NULL, NULL, 0, 'NULL', '\"[null]\"', '[]', NULL, 2, '2025-03-01 16:13:07', '2025-03-01 18:27:21'),
(56, 'SMOOTHIE BIKES', 'smoothie-bikes', 'Pedal to blend with a Smoothie Bike Blender—fun, healthy, and interactive.', '<p data-start=\"25\" data-end=\"559\" style=\"text-align: justify; \"><strong data-start=\"51\" data-end=\"109\">Smoothie Bike Blender – Pedal Your Way to Refreshment!</strong>&nbsp;</p><p data-start=\"25\" data-end=\"559\" style=\"text-align: justify; \">Blend your own smoothie with the power of pedaling using a <strong data-start=\"179\" data-end=\"204\">Smoothie Bike Blender</strong>! This fun, interactive experience combines fitness and refreshment, making it perfect for events, parties, schools, and health campaigns. As you pedal, the bike powers the blender, creating a delicious, fresh smoothie while promoting exercise and sustainability. A great way to engage guests, encourage healthy habits, and add excitement to any occasion!</p><p data-start=\"561\" data-end=\"760\"><div style=\"text-align: justify;\"><strong data-start=\"564\" data-end=\"605\" style=\"font-size: 1rem;\">Why Choose the Smoothie Bike Blender?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Combines fitness and fun</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Promotes healthy habits and sustainability</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Customizable to fit your event theme</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Perfect for all ages and groups</span></div></p><p data-start=\"762\" data-end=\"900\" style=\"text-align: justify; \"><span style=\"font-size: 1rem;\">&nbsp;Engage your guests and energize your event with the </span><strong data-start=\"957\" data-end=\"982\" style=\"font-size: 1rem;\">Smoothie Bike Blender</strong><span style=\"font-size: 1rem;\"> today!</span></p>', 1, 'service-1740827578-56.jpeg', '\"[null]\"', '[\"service-gallery-56-67c2eafbd21c7.jpeg\"]', NULL, 2, '2025-03-01 16:14:02', '2025-03-05 14:51:14'),
(57, 'FOOTBALL MEMORY GAME', 'football-memory-game', NULL, NULL, 0, 'NULL', '\"[null]\"', '[]', NULL, 2, '2025-03-01 16:17:42', '2025-03-01 18:26:54'),
(59, 'PHYSICAL PLEDGE', 'physical-pledge', 'Boost brand interaction with a dynamic, creative experience with Physical Pledge Wall.', '<p data-start=\"579\" data-end=\"649\" style=\"text-align: justify; \"><strong data-start=\"582\" data-end=\"644\">Engage, Inspire, and Create with the Physical Pledge Wall!</strong>&nbsp;</p><p data-start=\"651\" data-end=\"1008\" style=\"text-align: justify;\">Looking for a unique way to engage your guests and make your event unforgettable? The <strong data-start=\"737\" data-end=\"773\">Event Feedback Pledge Wall Dubai</strong> transforms ordinary feedback into an interactive, living masterpiece! This immersive experience allows your guests to creatively express their thoughts, pledges, and messages on a dynamic platform that comes to life on a big screen.</p><p data-start=\"1010\" data-end=\"1362\"><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;</span><strong data-start=\"1014\" data-end=\"1054\" style=\"font-size: 1rem;\">Why Choose the Physical Pledge Wall?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Guests can sketch, write, or pledge their thoughts, making them feel truly involved.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Fully customizable themes, backgrounds, and templates to match your brand’s identity.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Music and animations enhance the experience, keeping the energy high.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ Encourages real-time engagement and interaction.</span></div></p>', 1, 'service-1741077675-59.jpg', '\"[\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=XpBRFOu0gG4\\\",\\\"https:\\\\\\/\\\\\\/www.youtube.com\\\\\\/watch?v=q2Sf39B5l3E\\\"]\"', '[\"service-gallery-59-67c6ba22d6c62.jpg\",\"service-gallery-59-67c6ba22dd208.jpg\",\"service-gallery-59-67c6ba22e583f.jpg\"]', 'https://www.youtube.com/watch?v=vVU_7nw3GYw', 2, '2025-03-01 16:19:08', '2025-03-05 18:20:50'),
(60, 'ROAMING BOOTH', 'roaming-booth', 'Elevate event with a roaming photo booth, capturing fun candid moments.', '<p data-start=\"322\" data-end=\"381\" style=\"text-align: justify; \"><strong data-start=\"326\" data-end=\"377\">Roaming Photo Booth – Take the Fun Everywhere!</strong>&nbsp;</p><p data-start=\"383\" data-end=\"601\" style=\"text-align: justify; \">Make your event extraordinary with our <strong data-start=\"422\" data-end=\"446\">Photo Booth</strong>! Unlike traditional stationary booths, this mobile experience can roam the event space, capturing moments as guests mingle, laugh, and enjoy themselves.</p><p data-start=\"603\" data-end=\"877\" style=\"text-align: justify; \">Ideal for corporate events, weddings, private parties, and exhibitions, the <strong data-start=\"679\" data-end=\"703\">Portable Photo Booth</strong> brings the photo fun directly to your guests. With <strong data-start=\"755\" data-end=\"782\">instant digital sharing</strong> and <strong data-start=\"787\" data-end=\"810\">high-quality prints</strong>, everyone gets a personalized souvenir to remember the occasion.</p><p data-start=\"879\" data-end=\"1203\"><div style=\"text-align: justify;\"><strong data-start=\"882\" data-end=\"922\" style=\"font-size: 1rem;\">Why Choose the Portable Photo Booth?</strong></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"927\" data-end=\"948\" style=\"font-size: 1rem;\">Mobile &amp; flexible</strong><span style=\"font-size: 1rem;\"> – Moves through the crowd to capture spontaneous moments.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1011\" data-end=\"1039\" style=\"font-size: 1rem;\">Instant prints &amp; sharing</strong><span style=\"font-size: 1rem;\"> – Quick keepsakes for guests and instant digital shares.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">✅ </span><strong data-start=\"1101\" data-end=\"1126\" style=\"font-size: 1rem;\">Perfect for any event</strong><span style=\"font-size: 1rem;\"> – Suitable for all types of gatherings, from weddings to corporate events.</span></div></p><p data-start=\"1205\" data-end=\"1338\" data-is-last-node=\"\" data-is-only-node=\"\" style=\"text-align: justify; \">Create unforgettable memories and elevate your event with the <strong data-start=\"1267\" data-end=\"1291\">Portable Photo Booth</strong>!&nbsp;</p>', 1, 'service-1740825395-60.jpg', '\"[null]\"', '[\"service-gallery-60-67c6ea33c98c9.jpg\"]', 'https://www.youtube.com/watch?v=2WiDyGowHp8', 1, '2025-03-01 16:30:27', '2025-03-17 15:38:03');

